DROP TABLE IF EXISTS `tb_activity_config`;
CREATE TABLE `tb_activity_config` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `start_time` datetime DEFAULT NULL,
  `end_time` datetime DEFAULT NULL,
  `title` varchar(50) DEFAULT NULL,
  `add_days` int(11) DEFAULT NULL COMMENT '优惠券有效天数',
  `integral` int(11) DEFAULT '0' COMMENT '每次使用积分',
  `num` int(11) DEFAULT NULL COMMENT '每天可参与次数',
  `pic1` varchar(255) DEFAULT NULL COMMENT '头部背景图',
  `pic2` varchar(255) DEFAULT NULL COMMENT '主体背景图',
  `describe` varchar(255) DEFAULT NULL COMMENT '描述',
  `status` tinyint(1) DEFAULT '0' COMMENT '状态0-正常  1-禁用',
  `is_del` tinyint(1) DEFAULT '0' COMMENT '是否删除 0-否 1-是',
  `share_title` varchar(50) DEFAULT NULL COMMENT '分享标题',
  `share_desc` varchar(255) DEFAULT NULL COMMENT '分享描述',
  `share_logo` varchar(255) DEFAULT NULL COMMENT '分享logo',
  `list_pic` varchar(255) DEFAULT NULL COMMENT '列表图片',
  `list_title` varchar(255) DEFAULT NULL COMMENT '列表标题',
  `list_desc` varchar(255) DEFAULT NULL COMMENT '列表介绍',
  `prize_config` longtext COMMENT '商品奖品配置',
  `add_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

