  `is_cuxiao` char(1) DEFAULT NULL COMMENT '是否促销',
  `is_join` tinyint(1) DEFAULT '0' COMMENT '是否参加积分抵扣 0-否 1-是',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `goods_name` varchar(255) DEFAULT NULL COMMENT '商品名称',
  `goods_des` varchar(255) DEFAULT NULL COMMENT '商品简介',
  `goods_ser` varchar(255) DEFAULT NULL COMMENT '商品服务',
  `price` decimal(10,0) DEFAULT NULL COMMENT '现价',
  `oprice` decimal(10,0) DEFAULT NULL COMMENT '原价',
  `discount` decimal(10,0) DEFAULT NULL COMMENT '折扣',
  `stock` smallint(6) DEFAULT NULL COMMENT '库存',
  `logo_pic` varchar(255) DEFAULT NULL COMMENT '商品logo（小）',
  `index_pic` varchar(255) DEFAULT NULL COMMENT '产品首页展示图片（大）',
