  `spu` varchar(255) DEFAULT NULL COMMENT '商品编码',
  `goods_cap` varchar(255) DEFAULT NULL COMMENT '容量',
  `goods_mel` varchar(255) DEFAULT NULL COMMENT '产品型号',
  `goods_skin` varchar(255) DEFAULT NULL COMMENT '适用肤质',
  `goods_range` varchar(255) DEFAULT NULL COMMENT '适用范围',
  `goods_list` varchar(255) DEFAULT NULL COMMENT '上市时间',
  `goods_care` varchar(255) DEFAULT NULL COMMENT '适用注意事项',
  `goods_com` varchar(255) DEFAULT NULL COMMENT '产品成分',
  `detail` text COMMENT '商品详情',
  `is_sku` char(1) DEFAULT NULL COMMENT '是否sku',
  `goods_sku_info` varchar(500) DEFAULT NULL COMMENT 'sku',
  `integal` varchar(255) DEFAULT NULL COMMENT '赠送积分',
  `express` decimal(10,2) DEFAULT NULL COMMENT '快递费用 0-免邮 ',
  `is_groom` char(1) DEFAULT NULL COMMENT '是否推荐',
  `volume` int(11) DEFAULT '0' COMMENT '销量',
  `collection` int(11) DEFAULT '0' COMMENT '收藏量',
  `is_del` tinyint(4) unsigned DEFAULT '0' COMMENT '是否删除 1是删除 0不是删除',
  `del_time` varchar(255) DEFAULT NULL COMMENT '删除时间',
  `trial_start_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `trial_end_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `trial_num` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `comment` int(11) DEFAULT NULL,
  `goods_title` varchar(255) DEFAULT NULL COMMENT '商品列表标题',
  `name` varchar(255) DEFAULT NULL,
  `en_name` varchar(255) DEFAULT NULL,
  `pic` varchar(255) DEFAULT NULL,
  `title` varchar(255) DEFAULT NULL,
  `en_title` varchar(255) DEFAULT NULL,
  `pic2` varchar(255) DEFAULT NULL,
  `pic3` varchar(255) DEFAULT NULL,
  `pic4` varchar(255) DEFAULT NULL,
  `pic5` varchar(255) DEFAULT NULL,
  `content` text,
  `en_content` text,
  `content1` text,
  `en_content1` text,
  `content2` text,
  `en_content2` text,
  `content3` text,
  `en_content3` text,
  `status` int(11) DEFAULT NULL,
  `parameter` text COMMENT '产品参数（能效等级，安装位置等）',
  `edit_at` datetime DEFAULT NULL COMMENT '修改时间',
  `share_title` varchar(255) DEFAULT NULL COMMENT '分享标题',
  `share_desc` varchar(255) DEFAULT NULL COMMENT '分享描述',
  `share_logo` varchar(255) DEFAULT NULL COMMENT '分享图片',
  `create_at` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=63 DEFAULT CHARSET=utf8;

