  `sales` int(11) DEFAULT '0' COMMENT '销量',
  `limitbuy` int(11) DEFAULT '0' COMMENT '限购数量',
  `ischoice` enum('1','0') DEFAULT '0' COMMENT '1精选,0不是精选',
  `is_sku` int(4) DEFAULT '0' COMMENT '是否与sku',
  `ishot` tinyint(1) DEFAULT '0' COMMENT '1热卖,0否',
  `isnew` tinyint(1) DEFAULT '0' COMMENT '1新品,0否',
  `issale` tinyint(1) DEFAULT '0' COMMENT '1上架,0下架',
  `isabroad` tinyint(1) DEFAULT '0' COMMENT '海外 0否,1是',
  `ispresell` tinyint(1) DEFAULT NULL COMMENT '是否预售 0-否 1-是',
  `isbaoyou` tinyint(1) DEFAULT NULL COMMENT '是否包邮 0-否 1-是',
  `is_part_zhekou` tinyint(1) DEFAULT NULL COMMENT '是否参与会员折扣 0不参与- 1-参与',
  `isautodelivery` tinyint(1) DEFAULT NULL COMMENT '自动发货 0-否 1-是',
  `autodelivery_content` varchar(255) DEFAULT NULL COMMENT '自动发货内容',
  `sorts` int(11) DEFAULT '0' COMMENT '排序',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '售价',
  `costprice` decimal(10,2) DEFAULT '0.00' COMMENT '成本价',
  `oprice` decimal(10,2) DEFAULT '0.00' COMMENT '原价',
  `pifa_price` decimal(10,2) DEFAULT '0.00' COMMENT '批发价格',
  `integralprice` int(11) DEFAULT '0' COMMENT '可抵现积分',
  `giftpoints` int(11) DEFAULT '0' COMMENT '赠送积分',
  `postage` decimal(10,2) DEFAULT '0.00' COMMENT '邮费',
  `isdel` tinyint(1) DEFAULT '0' COMMENT '0显示,1删除',
  `timelimitid` int(11) DEFAULT NULL COMMENT '秒杀时间点ID',
  `create_at` datetime DEFAULT NULL COMMENT '添加时间',
  `edit_at` datetime DEFAULT NULL COMMENT '修改时间',
  `grouperson` int(11) DEFAULT NULL COMMENT '参团人数',
  `grouphour` int(11) DEFAULT NULL COMMENT '团结束时间(小时)',
  `isend` int(4) DEFAULT '1' COMMENT '0 已售罄 1 出售中',
