  `goods_sku_info` varchar(500) DEFAULT NULL COMMENT 'sku信息',
  `weight` int(10) NOT NULL DEFAULT '0' COMMENT '重量（g）',
  `exp_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '运费设置 1 运费模板 2 统一邮费',
  `express_fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '同一运费',
  `express_model` tinyint(5) NOT NULL DEFAULT '0' COMMENT '选择的运费模板id',
  `receivetime` int(2) NOT NULL DEFAULT '0' COMMENT '发货多少天确认收货 0读取系统设置 -1为不自动收货',
  `istui` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否支持退换货',
  `tui_address` varchar(300) DEFAULT NULL COMMENT '退货地址',
  `tagid` varchar(300) DEFAULT NULL COMMENT '标签id(，分割)',
  `goods_param` varchar(1000) DEFAULT NULL COMMENT '产品参数  产品属性',
  `is_buy_power` tinyint(1) DEFAULT NULL COMMENT '购买权限 0否,1是',
  `buy_dancinum` int(10) DEFAULT '0' COMMENT '单次最多购买',
  `buy_grade_power` varchar(500) DEFAULT NULL COMMENT '会员等级购买权限  序列化的',
  `member_grade_zhekou` varchar(1000) DEFAULT NULL COMMENT '会员等级折扣  序列化',
  `is_take_fenxiao` tinyint(1) DEFAULT '0' COMMENT '参与分销 0否,1是',
  `fenxiao_set` varchar(1000) DEFAULT NULL COMMENT '分销佣金设置',
  `is_hexiao` tinyint(1) DEFAULT '0' COMMENT '参与核销 0否,1是',
  `hexiao_type` tinyint(1) DEFAULT '0' COMMENT '兑换限时 0指定时间兑换,1限时兑换',
  `shiyong_qixian` tinyint(4) DEFAULT '0' COMMENT '自动使用期限',
  `youxiaoqi` int(10) DEFAULT NULL COMMENT '有效期',
  `is_use_jifen` int(11) DEFAULT NULL COMMENT '使用积分',
  `miaosha_time` varchar(255) DEFAULT NULL COMMENT '秒杀时间点',
  `tuan_num` int(10) DEFAULT '0' COMMENT '团购人数',
  `tuan_end_hour` smallint(6) unsigned DEFAULT '0' COMMENT '团购X小时候结束',
  `tuan_price` decimal(10,2) DEFAULT '0.00' COMMENT '团购价',
  `is_true_tuan` tinyint(1) DEFAULT '0' COMMENT '比成团 0否,1是',
  `is_tuan_limited_time` tinyint(1) DEFAULT '0' COMMENT '限制时间 0否,1是',
  `limited_time_start` int(10) DEFAULT NULL COMMENT '限时开始时间',
  `limited_time_end` int(10) DEFAULT NULL COMMENT '团购结束时间',
  `buysome` varchar(30) DEFAULT NULL COMMENT '买点',
  `shippingplace` varchar(20) DEFAULT '' COMMENT '发货地',
  `end_price` decimal(10,2) DEFAULT '0.00' COMMENT '设置底价',
  `time_limit` int(11) DEFAULT '0' COMMENT '砍价时限',
  `isshowlowprice` tinyint(1) DEFAULT '0' COMMENT '显示底价 0否,1是',
  `isbuy` tinyint(1) DEFAULT '0' COMMENT '没有底价可下单  0否,1是',
  `myself` tinyint(1) DEFAULT '0' COMMENT '自己砍价 0否,1是',
  `initiate` int(11) DEFAULT '0' COMMENT '发起次数',
  `total_time` int(11) DEFAULT '0' COMMENT '可砍价总数',
  `each_time` int(11) DEFAULT '0' COMMENT '每人可砍价次数',
  `total_act` tinyint(4) DEFAULT NULL COMMENT '活动可发起次数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='活动商品主表';

