  `receive_time` int(11) NOT NULL DEFAULT '0' COMMENT '收货时间',
  `is_applyrefund` tinyint(1) DEFAULT '0' COMMENT '是否申请退款 0 未申请  1申请  2取消申请',
  `applyrefund_time` int(11) DEFAULT '0' COMMENT '申请退款时间',
  `applyrefund_money` decimal(10,2) DEFAULT '0.00' COMMENT '申请退款金额',
  `is_refund` tinyint(1) DEFAULT '0' COMMENT '是否退款完成0-未完成  1-完成  2-拒绝',
  `refund_time` int(11) DEFAULT '0' COMMENT '退款时间',
  `refund_fee` decimal(10,2) DEFAULT '0.00' COMMENT '退款金额',
  `consignee` varchar(60) DEFAULT '' COMMENT '收货人',
  `province` varchar(50) DEFAULT '0' COMMENT '省',
  `city` varchar(50) DEFAULT '0' COMMENT '市',
  `district` varchar(50) DEFAULT '0' COMMENT '区县',
  `address` varchar(255) DEFAULT '',
  `zipcode` varchar(10) DEFAULT '',
  `tel` varchar(20) DEFAULT '',
  `mobile` varchar(20) DEFAULT '',
  `email` varchar(60) DEFAULT '',
  `total_fee` decimal(10,2) DEFAULT '0.00' COMMENT '订单金额',
  `discount_jifne` decimal(10,2) DEFAULT NULL,
  `discount` decimal(10,2) DEFAULT '0.00' COMMENT '优惠卷 优惠码优惠金额',
  `total_price` decimal(10,2) DEFAULT '0.00' COMMENT '商品总金额',
  `return_score` int(11) DEFAULT '0' COMMENT '返利积分',
  `is_valid` tinyint(1) DEFAULT '1' COMMENT '是否有效（0，取消订单；1有效订单）',
  `out_trade_no` varchar(255) DEFAULT NULL COMMENT '系统内部交易单号',
  `trade_no` varchar(255) DEFAULT NULL COMMENT '支付平台交易单号',
  `express_name` varchar(255) DEFAULT NULL COMMENT '快递公司',
  `express_no` varchar(50) DEFAULT NULL COMMENT '快递单号',
  `express_fee` decimal(10,2) NOT NULL COMMENT '快递费用',
  `province_id` int(11) NOT NULL COMMENT '省份id',
  `city_id` int(11) NOT NULL COMMENT '城市id',
  `district_id` int(11) NOT NULL COMMENT '区县id',
  `remark1` text NOT NULL COMMENT '备注1',
  `remark2` text NOT NULL COMMENT '备注2',
  `fenyong_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '分佣状态【1已分佣】',
  `wuliunum` varchar(50) DEFAULT NULL COMMENT '货运单号',
  `wuliucompany` int(10) DEFAULT NULL,
  `appoint` tinyint(1) NOT NULL DEFAULT '0' COMMENT '预约安装',
  `note` varchar(200) DEFAULT NULL,
  `invoice_type` text COMMENT '发票类型\n001 纸质发票-冠名发票 \n002 纸质发票-增值专票 \n003 纸质发票-增值普票 \n004 电子发票-增值专票 \n005 电子发票-增值普票',
  `invoice_title` text COMMENT '发票抬头',
  `invoice_company` varchar(100) DEFAULT NULL,
  `invoice_taxpayer_id` varchar(80) DEFAULT NULL COMMENT '纳税人识别号',
  `invoice_address` varchar(100) DEFAULT NULL COMMENT '注册地址',
  `invoice_phone` varchar(45) DEFAULT NULL COMMENT '注册电话',
  `invoice_bank` varchar(80) DEFAULT NULL COMMENT '开户银行',
  `invoice_bank_account` varchar(80) DEFAULT NULL COMMENT '银行账户',
  `extract` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否已提现',
  `person_tx` varchar(32) NOT NULL DEFAULT '0' COMMENT '个人是否提现字段 ',
  `tuan_tx` varchar(32) NOT NULL DEFAULT '0' COMMENT '团队提现字段',
  `person_tx_time` varchar(32) DEFAULT NULL,
  `tuan_tx_time` varchar(32) DEFAULT NULL,
  `order_type` tinyint(1) DEFAULT '0' COMMENT '订单类型【0.普通订单，1vip订单】',
  `source` tinyint(1) DEFAULT NULL COMMENT '订单来源【1.PC官网，2.移动官网、3.移动pc、4微信商城】',
  `couponsid` int(11) DEFAULT NULL COMMENT '优惠券id ',
  `consjifen` varchar(255) DEFAULT '0' COMMENT '使用积分',
  `is_yuyue` tinyint(4) DEFAULT '0' COMMENT '0:非预约 1预约',
  `is_choice` tinyint(1) DEFAULT '0' COMMENT '佣金计算 、0否  1是',
  `onelevel` decimal(10,2) DEFAULT '0.00' COMMENT '一级佣金',
  `twolevel` decimal(10,2) DEFAULT '0.00' COMMENT '二级佣金',
  `apply_service` tinyint(4) DEFAULT '0' COMMENT '0未申请售后，1：单个，2：申请全部',
  `liuyan` varchar(255) DEFAULT NULL,
  `is_del` tinyint(1) DEFAULT '0' COMMENT '0未删除  1已删除',
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_sn` (`order_no`) USING BTREE,
  KEY `user_id` (`user_id`) USING BTREE,
  KEY `order_status` (`order_status`) USING BTREE,
  KEY `pay_status` (`pay_status`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=145 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='订单表';

