INSERT INTO `tb_announ` VALUES ('1', '1', '油烟机的寿命大概有多久？', '', '德意电器', '', null, null, null, null, null, null, null, null, null, null, null, null, '<h5>专家建议:</h5><p>8年，但是也有用户使用10几年的。延长使用寿命，主要是平时正确的保养和使用。</p><p>采取正确的保养方式，例如油烟机1年清洗一次，并且每次做完饭后及时清洁油烟机；</p><p>在清洁时不要用百洁布、钢丝球、硬刷子等粗糙的工具，要用软布；清洗剂不要用威猛、蓝月亮等强酸、强碱性的，要用中性清洗剂，三个月清洗一次油网等。</p>', null, '', null, '2017-11-12', '1', null, null, '205', null, null, '8', null, null, '8年，但是也有用户使用10几年的。延长使用寿命，主要是平时正确的保养和使用。采取正确的保养方式，例如油烟机1年清洗一次，并且每次做完饭后及时清洁油烟机；在清洁时不要用百洁布、钢丝球、硬刷子等粗糙的工具，要用软布；清洗剂不要用威猛、蓝月亮等强酸、强碱性的，要用中性清洗剂，三个月清洗一次油网等。', '', '1');
INSERT INTO `tb_announ` VALUES ('2', '1', '油烟机插座应该安装在什么位置较为合适？', '', '德意电器', '', null, null, null, null, null, null, null, null, null, null, null, null, '<h5>专家建议:</h5><p>8年，但是也有用户使用10几年的。延长使用寿命，主要是平时正确的保养和使用。</p><p>采取正确的保养方式，例如油烟机1年清洗一次，并且每次做完饭后及时清洁油烟机；</p><p>在清洁时不要用百洁布、钢丝球、硬刷子等粗糙的工具，要用软布；清洗剂不要用威猛、蓝月亮等强酸、强碱性的，要用中性清洗剂，三个月清洗一次油网等。</p>', null, '', null, '2017-08-02', '1', null, null, '214', null, null, '9', null, null, '安装在需安装油烟机的上方，平顶下面20cm左右的地方，且要避免油烟机的出风口的即可。塔型机还应注意，插座的位置应该在电器控制盒的上方、装饰罩内部，不能与出风管或者电器盒干扰，又能保证美观。', '', '1');
INSERT INTO `tb_announ` VALUES ('3', '1', '灶具上进风和下进风的区别与优势分别是什么？', '', '德意电器', '', null, null, null, null, null, null, null, null, null, null, null, null, '<h5>专家建议:</h5><p>8年，但是也有用户使用10几年的。延长使用寿命，主要是平时正确的保养和使用。</p><p>采取正确的保养方式，例如油烟机1年清洗一次，并且每次做完饭后及时清洁油烟机；</p><p>在清洁时不要用百洁布、钢丝球、硬刷子等粗糙的工具，要用软布；清洗剂不要用威猛、蓝月亮等强酸、强碱性的，要用中性清洗剂，三个月清洗一次油网等。</p>', null, '', null, '2017-11-27', '1', null, null, '233', null, null, '10', null, null, '上进风的优势在于进气充足，燃烧充分；下进风的优势在于可以把面板做成全密封的，清洁性能好。方太的灶具是上下立体进风设计，结合了上进风和下进风两种进风方式的各自优势。', '', '1');
INSERT INTO `tb_announ` VALUES ('4', '2', '了解了这些让你的 厨房有型又有料', '', '德意电器', '', null, null, null, null, null, null, null, null, null, null, null, null, '<h5>尊敬的德意顾客:</h5><p>近期我们将对德意会员权益进行优化，我们将抽取部分德意会员进行会员权益问卷调查，非常感谢您的支持与参与！</p><p>活动时间:5月18日19：00——5月25日24：00</p><p>活动对象:所有收到短信的德意顾客</p><p>活动形式:在活动时间内参与并完整填写问卷，就有机会获得德意商城价值150元的澳洲进口JOCO随行咖啡杯一个。</p><p>结果公布:在活动结束的七个工作日内，我们将对问卷进行审查，确保问卷真实有效，从有效的问卷中随机抽取30名幸运玩家，并在德意商城网站上公布获奖者名单。在结果公布的七个工作日内，我们将安排礼品的发放。</p>', null, '', null, '2017-11-28', '1', null, null, '221', null, null, '11', null, null, '厨房做为精装住宅室内空间利用率高的地方之一，其设计备受业主关注，你的厨房怎么才能打造出有型又有料的厨房呢？相信这是许多业主关注的点。', '', '1');
INSERT INTO `tb_announ` VALUES ('5', '2', '“90后”YOUNG一代对精装有何要求？', '', '德意电器', '', null, null, null, null, null, null, null, null, null, null, null, null, '<h5>尊敬的德意顾客:</h5><p>近期我们将对德意会员权益进行优化，我们将抽取部分德意会员进行会员权益问卷调查，非常感谢您的支持与参与！</p><p>活动时间:5月18日19：00——5月25日24：00</p><p>活动对象:所有收到短信的德意顾客</p><p>活动形式:在活动时间内参与并完整填写问卷，就有机会获得德意商城价值150元的澳洲进口JOCO随行咖啡杯一个。</p><p>结果公布:在活动结束的七个工作日内，我们将对问卷进行审查，确保问卷真实有效，从有效的问卷中随机抽取30名幸运玩家，并在德意商城网站上公布获奖者名单。在结果公布的七个工作日内，我们将安排礼品的发放。</p>', null, '', null, '2017-11-22', '1', null, null, '229', null, null, '12', null, null, '为“90后”设计的精装方案必须做到“对症下药”。经过近年来房屋销售市场总结，这些个性十足的“90后”居住需求主要呈现出三大特征：第一，喜爱面积小而功能全的小型精装公寓；第二，崇尚有设计感的家居环境；第三，注重品牌，青睐高端家电。', '', '1');
INSERT INTO `tb_announ` VALUES ('6', '2', '一分钟带你辨别吸油烟机各种款式', '', '德意电器', '', null, null, null, null, null, null, null, null, null, null, null, null, '<h5>尊敬的德意顾客:</h5><p>近期我们将对德意会员权益进行优化，我们将抽取部分德意会员进行会员权益问卷调查，非常感谢您的支持与参与！</p><p>活动时间:5月18日19：00——5月25日24：00</p><p>活动对象:所有收到短信的德意顾客</p><p>活动形式:在活动时间内参与并完整填写问卷，就有机会获得德意商城价值150元的澳洲进口JOCO随行咖啡杯一个。</p><p>结果公布:在活动结束的七个工作日内，我们将对问卷进行审查，确保问卷真实有效，从有效的问卷中随机抽取30名幸运玩家，并在德意商城网站上公布获奖者名单。在结果公布的七个工作日内，我们将安排礼品的发放。</p>', null, '', null, '2017-11-12', '1', null, null, '216', null, null, '13', null, null, '近吸式：近吸式吸油烟机的进风口离油烟源头距离较近，缩短了油烟上升的运动距离，排烟效果更为理想。由于在集烟腔外观上采取了敞开式的造型，增大了烹饪空间范围，使得在做饭时不会存在压抑感，活动更加自由。', '', '1');
INSERT INTO `tb_announ` VALUES ('7', '3', '德意会员权益调查活动中奖公示', '', '德意电器', '', null, null, null, null, null, null, null, null, null, null, null, null, '<h5>尊敬的德意顾客:</h5><p>近期我们将对德意会员权益进行优化，我们将抽取部分德意会员进行会员权益问卷调查，非常感谢您的支持与参与！</p><p>活动时间:5月18日19：00——5月25日24：00</p><p>活动对象:所有收到短信的德意顾客</p><p>活动形式:在活动时间内参与并完整填写问卷，就有机会获得德意商城价值150元的澳洲进口JOCO随行咖啡杯一个。</p><p>结果公布:在活动结束的七个工作日内，我们将对问卷进行审查，确保问卷真实有效，从有效的问卷中随机抽取30名幸运玩家，并在德意商城网站上公布获奖者名单。在结果公布的七个工作日内，我们将安排礼品的发放。</p>', null, '', null, '2017-11-12', '1', null, null, '262', null, null, '14', null, null, '各位德意的会员们，感谢您们一直以来对德意的陪伴与支持，因为您们的踊跃参与，德意会员权益调查活动可以圆满结束。商城5.18-5.25德意会员权益调查活动获奖名单如下所示：', '', '1');
