INSERT INTO `tb_content` VALUES ('12', '12', null, '<div class=\"tit\">一、保外收费项目:服务费+零件费+远程费（单位：元/台）</div><div class=\"text\">1.服务费：服务费2则分为大修和小修，大、小修分类详见附件一。</div><p><img src=\"/Public/Admin/Ueditor/php/../../../../Uploads/upload_admin/20171111/1510388679277554.png\" width=\"100%\" title=\"ss3.png\"/></p><div class=\"text\">2.零件费：按德意公司2017年《服务收费手册》规定的标准收取。</div><div class=\"text\">3.远程费收费标准：</div><p><img src=\"/Public/Admin/Ueditor/php/../../../../Uploads/upload_admin/20171111/1510388769424250.png\" width=\"100%\" title=\"ss4.png\"/></p><div class=\"tit\">二、相关规定</div><div class=\"text\">1.同一台产品更换两个(含两个)以上的零件，零件费累加，维修费只收取一次。</div><div class=\"text\">2.上门同时维修两台（含两台）以上的德意产品时，远程费只收一次，不再累加。</div><div class=\"text\">3.上门仅调试则按小修标准的六折执行；若用户送修，维修费则按六折收取，零件费则仍按标准执行。</div><div class=\"text\">4.燃气置换统一按照保外服务收费执行，若有批量燃气置换的各服务单位一“工推”的形式向总部提报，按照公司批示的收费标准执行。</div>', '', '', '', '<span>保外</span>收费规定', '', 'Warranty charge Regulations', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '33', '', '1', '1', '', '', '', '', '', '', '', '', null);
