INSERT INTO `tb_content` VALUES ('35', '20', null, '<p>德意提供免费送货上门服务，物流人员会在派送前与您提前联系，并选择您方便的时间段进行派送，请您务必确认好收货地址，以免无人签收。</p>', '', '', '', '购买了德意产品，物流如何安排，是否收费？', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '47', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('36', '20', null, '<p>一般情况下，您购买的第二天即可安排发货。需要发货前，请提前一天与销售人员联系。\n						如果因为家里装修进度的需求，需要安排延长时间发货，可与销售人员沟通具体的延长时间。建议您延长的时间不宜过久，以免库存不足或产品下市给您造成的不便。</p>', '', '', '', '购买了德意产品，最快多久能安排发货？最晚多久能安排发货？', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '48', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('37', '20', null, '<ul class=\" list-paddingleft-2\"><li><p>如您收到的产品包装箱已经破损，请跟快递人员一起开箱验货；</p></li><li><p>如产品包装箱完好，可以直接签收，待安装技师上门安装时一起开箱验货；</p></li><li><p>在您需要时，自行开箱验货；无论哪种验货方式，如果发现物流途损或质量问题，请及时联系德意，我们会尽快为您解决，直至您满意。</p></li></ul>', '', '', '', '德意支持的验货方式', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '49', '', '1', '1', '', '', '', '', '', '', '', '', null);
