INSERT INTO `tb_content` VALUES ('157', '8', null, '<p>产品是德意的第一竞争力，产品的关键在设计创新。19年来，德意稳健快速的发展关键依托于创新能力，通过创新提供行业中具有差异性、高价值商品的能力来获得市场份额。<br/>我们深信，产品设计创新是德意实现未来品牌目标的战略驱动。</p>', '', '', '', '设计开启未来', '', 'Design opens the future', '', '/Uploads/Picture/20171116/5a0d77bb8ca00.jpg', '/Uploads/Picture/20171116/5a0d77c683590.jpg', '', '', null, '', '', '', '', '', '', '', '', '178', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('158', '8', null, '<p>德意厨卫电器专注于厨房、卫生间电器业务领域，致力于打造中国厨卫电器行业第—高端强势品牌。<br/>在新时代，德意紧扣全球厨卫电器市场脉搏，洞悉消费需求的本质，传承、发扬企业19年来的优势基因——设计，制定了“设计开启未来”的品牌发展战略。以设计来诠释“创享非凡”这一品牌价值观和品牌信仰，带给德意的消费者愉悦的生活体验；以创新性、前瞻性的设计来驱动品牌的发展，构筑竞争壁垒，赢得未来。</p>', '', '', '', '我们的品牌', '', 'OUR BRAND', '', '/Uploads/Picture/20171116/5a0d782f55b18.jpg', '/Uploads/Picture/20171116/5a0d7839cb5e8.jpg', '', '', null, '', '', '', '', '', '', '', '', '179', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('159', '8', null, '<p>德意标志做为德意电器股份有限公司的形象载体，是公司的重要资产，突出了德意的特点，例如国际化、简约化、差异化、专业化与创新性。它不仅是一个符号，还是德意核心价值的象征。因此，在应用本标志时，必须合乎规范，以确保品牌形象的完整和统一。<br/>设计的两大元素：英文“DE&amp;E”、中文“德意”。</p>', '', '', '', '标志诠释', '', 'SIGN INTERPRETATION', '', '/Uploads/Picture/20171116/5a0d787867458.jpg', '/Uploads/Picture/20171116/5a0d78571b968.jpg', '', '', null, '', '', '', '', '', '', '', '', '180', '', '1', '1', '', '', '', '', '', '', '', '', null);
