INSERT INTO `tb_content` VALUES ('218', '54', null, '<p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(1).反对宪法所确定的基本原则的；</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(2).危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(3).损害国家荣誉和利益的；</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(4).煽动民族仇恨、民族歧视，破坏民族团结的；</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(5).破坏国家宗教政策，宣扬邪教和封建迷信的；</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(6).散布谣言，扰乱社会秩序，破坏社会稳定的；</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(7).散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(8).侮辱或者诽谤他人，侵害他人合法权益的；</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(9).含有法律、行政法规禁止的其他内容的。</p><p><br/></p>', '', '', '', '3．用户在本商城上交易平台上不得发布下列违法信息：', '', '', '', '/Uploads/Picture/20171209/2017120915241817519.png', '', '', '', null, '2017-12-09', '', '', '', '', '', '', '', '269', '', '1', '1', '', '', '', '', '', '', '', '', null);
