INSERT INTO `tb_content` VALUES ('235', '54', null, '<p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">用户或本商城可随时根据实际情况中断一项或多项服务。本商城不需对任何个人或第三方负责而随时中断服务。用户若反对任何服务条款的建议或对后来的条款修改有异议，或对本商城服务不满，用户可以行使如下权利：</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(1) 不再使用本商城信息服务。</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(2) 通知本商城停止对该用户的服务。</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">结束用户服务后，用户使用本商城服务的权利马上中止。从那时起，用户没有权利，本商城也没有义务传送任何未处理的信息或未完成的服务给用户或第三方。</p><p><br/></p>', '', '', '', '14．结束服务', '', '', '', '/Uploads/Picture/20171209/2017120915373290734.png', '', '', '', null, '', '', '', '', '', '', '', '', '286', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('236', '54', null, '<p><span style=\"color: rgb(128, 130, 133); font-family: 微软雅黑, Arial; font-size: 13px; letter-spacing: 1px; background-color: rgb(255, 255, 255);\">所有发给用户的通告都可通过重要页面的公告或电子邮件或常规的信件传送。服务条款的修改、服务变更、或其它重要事件的通告都会以此形式进行。</span></p>', '', '', '', '15．通告', '', '', '', '/Uploads/Picture/20171209/2017120915375434997.png', '', '', '', null, '2017-12-09', '', '', '', '', '', '', '', '287', '', '1', '1', '', '', '', '', '', '', '', '', null);
