INSERT INTO `tb_content` VALUES ('238', '54', null, '<p><span style=\"color: rgb(128, 130, 133); font-family: 微软雅黑, Arial; font-size: 13px; letter-spacing: 1px; background-color: rgb(255, 255, 255);\">本商城信息服务条款要与中华人民共和国的法律解释一致。用户和本商城一致同意服从本商城所在地有管辖权的法院管辖。如发生本商城服务条款与中华人民共和国法律相抵触时，则这些条款将完全按法律规定重新解释，而其它条款则依旧保持对用户的约束力。</span></p>', '', '', '', '17．法律', '', '', '', '/Uploads/Picture/20171209/2017120915382930162.png', '', '', '', null, '2017-12-09', '', '', '', '', '', '', '', '289', '', '1', '1', '', '', '', '', '', '', '', '', null);
