INSERT INTO `tb_content` VALUES ('243', '55', null, '<p><span style=\"color: rgb(128, 130, 133); font-family: 微软雅黑, Arial; font-size: 13px; letter-spacing: 1px; background-color: rgb(255, 255, 255);\">当您访问本商城或用商城客服在线客服、QQ给我们发送电子邮件时，我们默认您同意以任何电子方式接受我们的信息。我们将用电子联系方式或通过电话的方式与您进行联系。您同意我们用电子方式提供给您的所有协议、通知、披露和其他信息是符合此类通讯必须是书面形式的法定要求的。如果并且当本商城能够证明以电子形式的信息已经发送给您或者在本商城张贴这样的通知，将被视为您已收到所有协议、声明、披露和其他信息。</span></p>', '', '', '', '电子通讯', '', '', '', '/Uploads/Picture/20171209/2017120915405095304.png', '', '', '', null, '2017-12-09', '', '', '', '', '', '', '', '282', '', '1', '1', '', '', '', '', '', '', '', '', null);
