INSERT INTO `tb_content` VALUES ('304', '71', null, '<h5>卡券类产品Q&amp;A：</h5><p>（1）兑换时间：卡券类产品数量有限兑完即止，会按照标题显示时间补充库存，如有兑换需要请注意时间。</p><p>（2）兑换要求：卡券类产品库存有限，单笔订单仅限兑换一张，感谢您的理解。</p><p>（3）注意问题：务必确保所留的电话号码是准确的。</p><p>①卡券类别：卡券类产品分为实体卡和电子卡两种，页面均有标注，电子卡为虚拟产品，无物流信息展现。</p><p>②拍前必读：由于电子卡的特殊产品属性，拍下前请仔细核对您的手机号，若需要修改手机号，请联系在线客服，由于顾客号码填写错误导致的损失积分商城概不承担，感谢理解。</p><p>③话费卡兑换须知：话费卡在兑换成功后2个工作日内到账，按每次100元分批次充值到账，充值金额超过100元的订单若有部分金额延迟到账属于正常现象，最晚到账时间不会超过2个工作日。</p><p>④京东卡等电子充值卡兑换后通过卡号和密码激活，卡密会以短信形式发送到您的手机号，拍下前请仔细核对您的手机号，需要修改手机号，请联系在线客服。</p>', '', '', '', '德意积分商城兑换须知', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '321', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('272', '60', null, '<p>本商城提供网银付款方式，请在下单时选择正确的银联卡，感谢支持。</p>', '', '', '', '网银支付', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '289', '', '1', '1', '', '', '', '', '', '', '', '', null);
