INSERT INTO `tb_content` VALUES ('273', '61', null, '<p>本商城产品配送，首选国家“AAAAA”级物流企业——德邦物流（个别偏远地区除外），快速高效、便捷及时、安全可靠，确保顾客购买无忧！如有疑问，请联系客服进行咨询。</p>', '', '', '', '配送方式', '', '', '', '', '', '', '', null, '2015-08-10', '', '', '', '', '', '', '', '290', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('274', '62', null, '<h4>目前本商城支持三种验货方式</h4><p>1、如您收到的产品包装箱已经破损，请跟快递人员一起开箱验货；</p><p>2、如产品包装箱完好，可以直接签收，待安装技师上门安装时一起开箱验货；</p><p>3、在您需要时，自行开箱验货，但建议保留相关证据；</p><p>\n										无论哪种验货方式，如果发现物流途损或质量问题，请及时联系我们，德意会尽快为您解决问题，直至您满意。同时建议您在安装完成后，将包装箱折叠保留3个月以上，如后期涉及退换货等售后问题，可以直接使用原包装，避免您个人承担二次包装费。</p>', '', '', '', '验货签收', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '291', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('275', '63', null, '<p>您购买的产品将由宁波总部为您发出。一般情况下：</p><p>1） 江浙沪地区1-3天到货；</p><p>2） 省会及地级市3-5天到货；</p><p>3） 县城5-7天到货；</p><p>4） 个别偏远地区7-15天到货；</p><p>以上为预计时间，如遇恶劣天气，或物流高峰期，会产生一定延迟，敬请谅解！</p>', '', '', '', '1、配送时间', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '292', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('284', '63', null, '<p>德意提供送货上门服务，请您务必确认好收货地址，以免无人签收。由于包装较大，快递送货上门时，希望您可以帮忙搭把手。如果快递的服务不能让您满意，请拨打9510-5898，我们会竭尽全力为您解决问题！</p>', '', '', '', '2、送货上门', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '301', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('285', '63', null, '<p>快递员会在派送前与您提前联系，并选择您方便的时间段进行派送，避免出现无人签收的状况。</p>', '', '', '', '3、送前联系', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '302', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('286', '63', null, '<p>北京地区货到付款线下机订单，支付方式仅限于支付宝/微信付款。</p><p>其他地区货到付款订单，支付方式仅限于现金/刷卡。</p><p>发货前将电话与您联系确认。</p>', '', '', '', '4、货到付款', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '303', '', '1', '1', '', '', '', '', '', '', '', '', null);
