INSERT INTO `tb_content` VALUES ('277', '65', null, '<table border=\"1\"><tbody><tr class=\"firstRow\"><th rowspan=\"2\">项目产品</th><th colspan=\"2\">包修期限</th><th rowspan=\"2\">服务承诺</th></tr><tr><th>整机</th><th>特别说明</th></tr><tr><td>油烟机</td><td>五年</td><td>电机终身包修；白炽灯泡包修一年</td><td>免费预埋烟管、免费安装、终身上门维修</td></tr><tr><td>灶具</td><td>一年</td><td>阀体包修三年</td><td>免费安装；终身上门维修</td></tr><tr><td>消毒柜</td><td>一年</td><td>电脑板、控制板包修三年</td><td>免费安装；终身上门维修</td></tr><tr><td>烤箱</td><td>一年</td><td>电源板、控制板、加热管、循环电机、冷却电机包修三年</td><td>免费安装；终身上门维修</td></tr><tr><td>微波炉</td><td>一年</td><td>电脑版、磁控管、变压器包修三年</td><td>免费安装；终身上门维修</td></tr><tr><td>蒸箱</td><td>一年</td><td>电子开关、加热盘、电脑板包修三年</td><td>免费安装；终身上门维修</td></tr></tbody></table>', '', '', '', '服务政策', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '295', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('278', '65', null, '<p>1、退款操作</p><p>请联系客服申请退款；</p><p>2、退款周期</p><p>提交退款申请后15个工作日内；</p><p>3、退款账户</p><p>支付宝支付用户款项返回原有账号，其他付款方式请与工作人员联系，提供退款账户。</p>', '', '', '', '退款说明', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '296', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('279', '65', null, '<p>收到货后，请拨打德意全国统一服务热线95105898进行预约安装，有服务网点城市提供免费安装服务（暂不支持墙面开孔、做支架、拆旧机、标配外零部件等项目），个别偏远地区没有服务网点城市需自行安装，敬请谅解。</p>', '', '', '', '安装与维修', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '297', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('280', '65', null, '<p>我们将细心回答您所提出的任何与德意产品及服务相关的问题。</p><p>全国统一服务热线:95105898</p>', '', '', '', '咨询与投诉', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '298', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('283', '60', null, '<p>请在48小时内完成付款， 超过时间系统将自动取消订单，请您及时付款以免影响收货周期。</p>', '', '', '', '付款说明', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '300', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('287', '66', null, '<p>1、客户在收到货物时当面在送货员面前拆包检查，发现货物有质量问题的；</p><p>2、实际收到货物与商城上描述的有很大的出入的。</p><p>3、换货流程：客户当面要求送货人员退回货物，然后与我们联系。我们会为您重新发货，货物到达时间顺延。</p>', '', '', '', '符合以下条件，可以要求换货', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '304', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('288', '66', null, '<p>1、客户收到货物后七天之内，发现商品有明显的制造缺陷的；</p><p>2、货物经过一次换货但仍然存在质量问题的；</p><p>3、退货流程：客户在收到货物后七天内与我们联系，我们会在五个工作日内将货款返还。</p>', '', '', '', '符合以下条件，可以要求退货', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '305', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('289', '66', null, '<p>1、货物出现破损，但没有在收货时当场要求送货人员换货的；</p><p>2、超过退换货期限的退换货要求；</p><p>3、退换货物不全或者外观受损；</p><p>4、客户发货单据丢失或者不全；</p><p>5、产品并非我们提供；</p><p>6、货物本身不存在质量问题的。</p>', '', '', '', '以下情况，我们有权拒绝客户的退换货要求', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '306', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('290', '67', null, '<p>请联系9510-5898申请退换货。</p>', '', '', '', '退款操作', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '307', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('291', '67', null, '<p>提交退货申请后，7到15个工作日内到账。</p>', '', '', '', '退款周期', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '308', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('292', '67', null, '<p>3个月内直接通过关联支付宝链接支付的用户款项返回原有账户；超出三个月外支付宝支付用户以及通过支付宝转账或其他付款方式支付的用户款项需要用户提供退款账户，银行卡退款账户需提供：银行卡号+该卡号实名认证人姓名+银行所在省市区域+具体支行信息；支付宝退款账号需提供：支付宝账号+实名认证姓名；联系工作人员退款。</p>', '', '', '', '退款账户', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '309', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('293', '68', null, '<p>首先您可以通过浏览商城了解商品。看到您满意的商品您可以直接在我们的商城上实现订购。您也可以和我们商城的客服人员联系订购。</p>', '', '', '', '如何订购商品？', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '310', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('294', '68', null, '<p>1、德意集团官方商城，原厂直销，品质保证；</p><p>2、多种付款方式以及物流的全国配送；</p><p>3、人性化的退换货事宜；</p><p>4、体贴入微的会员积分计划；</p><p>5、我们有正规大型实体店，品种齐全，安全、信誉有保障；</p>', '', '', '', '请告诉我在这里购物的理由好吗？', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '311', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('295', '68', null, '<p>目前商城查找的都是可以订购的，但是必须是仓库中有库存的产品我们才可以与您确认。部分热销产品也可以通过我们的商城做一个预约，等到货品到后，我们会立即通过电话或者电子邮件的方式通知您来订购。</p>', '', '', '', '所有的产品都能够在商城上购买?', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '312', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('296', '68', null, '<p>1、只有注册用户才可以在网上进行订购，享受优惠的价格。</p><p>2、只有注册用户才可以登录【会员中心】，使用更多的会员购物功能，管理自己的资料。</p><p>3、只有注册用户才可以在网上给其他注册的朋友留言。</p><p>4、只有注册用户才有机会获取我们赠送的礼品。</p>', '', '', '', '为什么要注册会员？', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '313', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('297', '68', null, '<p>为了保护客户利益，我们无法看到您的密码。当您忘记密码时，请登录注册页面，点击&quot;忘记密码&quot;，系统会自动将您的密码通过email告诉您，您可以登录【会员中心】去更改密码，以确保您的利益，或者联系我们的客服，提供证据，我们将24小时之内解决您的问题。</p>', '', '', '', '忘记了密码怎么办？', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '314', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('298', '68', null, '<p>积分的高低只反映您对我们的关注和支持程度。我们的积分是通过订购商品产生的。对于高积分的客户我们会有一定的奖励，如积分兑换商品、积分抵扣价格、赠送商品，以更优惠的价格购买商品等，以此回馈广大顾客。</p>', '', '', '', '积分是怎么回事？有什么作用？', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '315', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('299', '69', null, '<p>按照订单中商品金额或者商品可得积分，订单状态为已发货后可获得相应的积分 。</p>', '', '', '', '积分增加', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '316', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('300', '69', null, '<p>会员可进入【会员中心】——【会员信息】中查看自己的积分情况。</p>', '', '', '', '积分查询', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '317', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('301', '69', null, '<p>积分长期有效。除非本商城取消积分奖励计划。如果取消积分奖励计划我们会提前通知广大用户。</p>', '', '', '', '积分有效期', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '318', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('302', '69', null, '<p>本积分奖励计划由本商城制定并保留所有的解释权和修改权。修改以商城公布为准，不做另行通知。</p>', '', '', '', '积分说明', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '319', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content` VALUES ('305', '72', null, '<p>\n							德意积分商城至2014年10月上线以来，已服务过1W+用户（截止2017年9月）；积累了丰富的服务经验，将继续致力于提供“五心”服务。如下要点，您使用积分前一定要Get的，让您的积分权益发挥到最大。</p><h5>积分：</h5><p>德意积分是德意诚挚回报用户的一种方式，通过参与德意商城、生活家、我陪孩子读经典、德意官方微信、老友技等平台的活动，按照其活动规则获得相应积分。</p><h5>积分使用：</h5><p>积分在可以再积分商城（http://unohacha.hk:9090/case/dysc5/integral.html）兑换各类商品， 也可使用积分参与抽奖或各平台策划的活动。</p><h5>积分获取：</h5><p>参与德意策划的各类活动，如在德意商城上购物、评价、再如参与我陪孩子读经典、德意生活家、老友技、德意官微组织的活动，根据相应活动规则获相应积分。</p><h5>积分时效：</h5><p>1) 积分到账时间：完成相应动作后，积分将实时到账；各平台积分汇总到积分商城账号有5个小时以内的延时，请您耐心等候。</p><p>2) 积分时效：积分时效为12个月，过期该积分将会自动衰减。请您务必注意积分时效，在时效内更好的行使您的积分权益。</p>', '', '', '', '德意积分商城要点', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '322', '', '1', '1', '', '', '', '', '', '', '', '', null);
