INSERT INTO `tb_content_copy` VALUES ('7', '16', null, '<h2><span>360°</span> 精诚服务</h2><h3>实现服务全程无忧</h3>', '', '', '', '360° 精诚服务', '9510 5898', '', '', '/Uploads/Picture/20171111/5a06ac73a1bdb.jpg', '', '', '', null, '已拥有1000+服务网点，为您提供更便捷的服务。 <br>德意“意粉荟”，以福利活动、美食课堂、生活资讯、人文关怀等多种形式，与您交流“0距离”、互动“0距离”、服务“0距离”。', '', '', '', '', '', '', '', '7', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('8', '11', null, '<ul class=\" list-paddingleft-2\"><li><p>体验一：厨房安检提醒，推行全面检查厨房电、气安全服务，让您感受安全贴心</p></li><li><p>体验二：无忧通检服务，上门服务时对您家德意电器全系产品检查，让您使用更安心</p></li><li><p>体验三：乐享美食课堂，定期开展免费乐享美食课堂，让您免费体验美食及烹饪乐趣</p></li></ul>', '', '', '', '三重非凡体验', '', '', '', '/Uploads/Picture/20171111/5a06ae2b304e6.jpg', '', '', '', null, '多角度免费体验，切身感受德意全方位服务体系', '', '', '', '', '', '', '', '10', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('9', '11', null, '<ul class=\" list-paddingleft-2\"><li><p>价值一：24小时在线服务，全年无休</p></li><li><p>价值二：24小时服务到家（县级区域48小时）</p></li><li><p>价值三：免费预埋烟管</p></li><li><p>价值四：免费安装和使用指导</p></li><li><p>价值五：油烟机产品电机终身包修、整机五年包修</p></li><li><p>价值六：100%原厂配件</p></li></ul>', '', '', '', '六大核心价值', '', '', '', '/Uploads/Picture/20171111/5a06af122f88e.jpg', '', '', '', null, '服务的核心是为用户创造价值', '', '', '', '', '', '', '', '11', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('10', '11', null, '<p>德意就在您身边，服务就在您身边！</p>', '', '', '', '零距离 贴心服务', '', '', '', '/Uploads/Picture/20171111/5a06b0363af8b.jpg', '', '', '', null, '德意“意粉荟”，以福利活动、美食课堂、生活资讯、人文关怀等多种形式，与您交流“0距离”、互动“0距离”、服务“0距离”。', '', '', '', '', '', '', '', '12', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('11', '12', null, '<p><img src=\"/Public/Admin/Ueditor/php/../../../../Uploads/upload_admin/20171111/1510388535128234.png\" style=\"float:none;\" title=\"ss1.png\"/></p><p><img src=\"/Public/Admin/Ueditor/php/../../../../Uploads/upload_admin/20171111/1510388535320027.png\" style=\"float:none;\" title=\"ss2.png\"/></p>', '', '', '', '<span>360°</span>服务承诺', '', '360° service commitment', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '27', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('12', '12', null, '<div class=\"tit\">一、保外收费项目:服务费+零件费+远程费（单位：元/台）</div><div class=\"text\">1.服务费：服务费2则分为大修和小修，大、小修分类详见附件一。</div><p><img src=\"/Public/Admin/Ueditor/php/../../../../Uploads/upload_admin/20171111/1510388679277554.png\" width=\"100%\" title=\"ss3.png\"/></p><div class=\"text\">2.零件费：按德意公司2017年《服务收费手册》规定的标准收取。</div><div class=\"text\">3.远程费收费标准：</div><p><img src=\"/Public/Admin/Ueditor/php/../../../../Uploads/upload_admin/20171111/1510388769424250.png\" width=\"100%\" title=\"ss4.png\"/></p><div class=\"tit\">二、相关规定</div><div class=\"text\">1.同一台产品更换两个(含两个)以上的零件，零件费累加，维修费只收取一次。</div><div class=\"text\">2.上门同时维修两台（含两台）以上的德意产品时，远程费只收一次，不再累加。</div><div class=\"text\">3.上门仅调试则按小修标准的六折执行；若用户送修，维修费则按六折收取，零件费则仍按标准执行。</div><div class=\"text\">4.燃气置换统一按照保外服务收费执行，若有批量燃气置换的各服务单位一“工推”的形式向总部提报，按照公司批示的收费标准执行。</div>', '', '', '', '<span>保外</span>收费规定', '', 'Warranty charge Regulations', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '28', '', '1', '1', '', '', '', '', '', '', '', '', null);
