INSERT INTO `tb_content_copy` VALUES ('14', '12', null, '<p><img src=\"/Public/Admin/Ueditor/php/../../../../Uploads/upload_admin/20171111/1510388878247776.png\" width=\"100%\" title=\"ss6.png\"/></p>', '', '', '', '<span>安装辅材</span>价格参考表', '', 'Installation accessories price reference table', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '30', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('15', '13', null, '<p>\n									1、吸油烟机在以下条件下使用：</p><p>\n									（1）、温度：-15℃- +40℃；</p><p>\n									（2）、相对湿度：不大于+90%（25℃）；</p><p>\n									（3）、海拔高度：不超过1000m；</p><p>\n									2、吸油烟机电源插座必须使用有可靠地线的专用插座；</p><p>\n									3、按照说明书安装好吸油烟机，一般安装高度不应低于650mm，尽可能安装在炉灶的正上方；</p><p>\n									4、出风管应尽量的缩短，转弯半径要尽可能的大，这样就能使出风畅顺，抽烟效果好而且噪音减小；</p><p>\n									5、安装在带有止回阀的公共烟道时，必须先检查好止回阀是否能够正常打开工作；</p><p>\n									6、安装烟机时必须保持烟机的水平度，若有倾斜将影响机内油路的流动，可能会出现漏油现象；</p><p>\n									7、安装时尽量使用原配的排烟管、避免急转弯。厨房采取正确的通风方式，能有效地降低噪音，并可在低风速下获得极佳的排油效果；</p><p>\n									8、厨房必须通风，以补充灶具燃烧时所需要的空气，同时防止因缺氧而发生的意外；</p><p>\n									9、厨房的油烟是发生肺部鳞癌和肺腺癌的危害之一，气味降低度测试和延时关机功能确保有效清除厨房残留油；</p><p>\n									10、炖、煮时通常只产生少量味道的水蒸气，调低风速可有效降低噪音；</p><p>\n									11、应在烹饪前或者结束后开启吸油烟机1-2分钟，以获得较好的清除油烟效果；</p><p>\n									12、更换灯泡、清洗吸油烟机前，都应拔掉插头切断电源；</p><p>\n									13、更换灯泡时功率不能超过灯座附近和说明书上的标示的最大值，否则，会使得连接灯座的电线和灯座的温升过高，加速电线绝缘层的老化，造成触电的潜在危险，甚至导致火灾；</p><p>\n									14、按说明书的要求经常清洗油烟机表面的油污和积垢，清洗时请用中性洗涤剂和软布,以免损坏外壳表面或涂层；</p><p>\n									15、油杯中的污油，积存至八分满时，将之倒弃，以免溢出；</p><p>\n									16、严禁非专业人员拆卸产品（油杯除外）；</p>', '', '', '', '吸油烟机应该如何使用和保养', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '27', '2017-10-16', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('16', '13', null, '<p>\n									1、吸油烟机在以下条件下使用：</p><p>\n									（1）、温度：-15℃- +40℃；</p><p>\n									（2）、相对湿度：不大于+90%（25℃）；</p><p>\n									（3）、海拔高度：不超过1000m；</p><p>\n									2、吸油烟机电源插座必须使用有可靠地线的专用插座；</p><p>\n									3、按照说明书安装好吸油烟机，一般安装高度不应低于650mm，尽可能安装在炉灶的正上方；</p><p>\n									4、出风管应尽量的缩短，转弯半径要尽可能的大，这样就能使出风畅顺，抽烟效果好而且噪音减小；</p><p>\n									5、安装在带有止回阀的公共烟道时，必须先检查好止回阀是否能够正常打开工作；</p><p>\n									6、安装烟机时必须保持烟机的水平度，若有倾斜将影响机内油路的流动，可能会出现漏油现象；</p><p>\n									7、安装时尽量使用原配的排烟管、避免急转弯。厨房采取正确的通风方式，能有效地降低噪音，并可在低风速下获得极佳的排油效果；</p><p>\n									8、厨房必须通风，以补充灶具燃烧时所需要的空气，同时防止因缺氧而发生的意外；</p><p>\n									9、厨房的油烟是发生肺部鳞癌和肺腺癌的危害之一，气味降低度测试和延时关机功能确保有效清除厨房残留油；</p><p>\n									10、炖、煮时通常只产生少量味道的水蒸气，调低风速可有效降低噪音；</p><p>\n									11、应在烹饪前或者结束后开启吸油烟机1-2分钟，以获得较好的清除油烟效果；</p><p>\n									12、更换灯泡、清洗吸油烟机前，都应拔掉插头切断电源；</p><p>\n									13、更换灯泡时功率不能超过灯座附近和说明书上的标示的最大值，否则，会使得连接灯座的电线和灯座的温升过高，加速电线绝缘层的老化，造成触电的潜在危险，甚至导致火灾；</p><p>\n									14、按说明书的要求经常清洗油烟机表面的油污和积垢，清洗时请用中性洗涤剂和软布,以免损坏外壳表面或涂层；</p><p>\n									15、油杯中的污油，积存至八分满时，将之倒弃，以免溢出；</p><p>\n									16、严禁非专业人员拆卸产品（油杯除外）；</p>', '', '', '', '吸油烟机应该如何使用和保养', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '27', '2017-10-16', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('17', '13', null, '<p>\n									1、吸油烟机在以下条件下使用：</p><p>\n									（1）、温度：-15℃- +40℃；</p><p>\n									（2）、相对湿度：不大于+90%（25℃）；</p><p>\n									（3）、海拔高度：不超过1000m；</p><p>\n									2、吸油烟机电源插座必须使用有可靠地线的专用插座；</p><p>\n									3、按照说明书安装好吸油烟机，一般安装高度不应低于650mm，尽可能安装在炉灶的正上方；</p><p>\n									4、出风管应尽量的缩短，转弯半径要尽可能的大，这样就能使出风畅顺，抽烟效果好而且噪音减小；</p><p>\n									5、安装在带有止回阀的公共烟道时，必须先检查好止回阀是否能够正常打开工作；</p><p>\n									6、安装烟机时必须保持烟机的水平度，若有倾斜将影响机内油路的流动，可能会出现漏油现象；</p><p>\n									7、安装时尽量使用原配的排烟管、避免急转弯。厨房采取正确的通风方式，能有效地降低噪音，并可在低风速下获得极佳的排油效果；</p><p>\n									8、厨房必须通风，以补充灶具燃烧时所需要的空气，同时防止因缺氧而发生的意外；</p><p>\n									9、厨房的油烟是发生肺部鳞癌和肺腺癌的危害之一，气味降低度测试和延时关机功能确保有效清除厨房残留油；</p><p>\n									10、炖、煮时通常只产生少量味道的水蒸气，调低风速可有效降低噪音；</p><p>\n									11、应在烹饪前或者结束后开启吸油烟机1-2分钟，以获得较好的清除油烟效果；</p><p>\n									12、更换灯泡、清洗吸油烟机前，都应拔掉插头切断电源；</p><p>\n									13、更换灯泡时功率不能超过灯座附近和说明书上的标示的最大值，否则，会使得连接灯座的电线和灯座的温升过高，加速电线绝缘层的老化，造成触电的潜在危险，甚至导致火灾；</p><p>\n									14、按说明书的要求经常清洗油烟机表面的油污和积垢，清洗时请用中性洗涤剂和软布,以免损坏外壳表面或涂层；</p><p>\n									15、油杯中的污油，积存至八分满时，将之倒弃，以免溢出；</p><p>\n									16、严禁非专业人员拆卸产品（油杯除外）；</p>', '', '', '', '吸油烟机应该如何使用和保养', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '27', '2017-10-16', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('18', '13', null, '<p>\n									1、吸油烟机在以下条件下使用：</p><p>\n									（1）、温度：-15℃- +40℃；</p><p>\n									（2）、相对湿度：不大于+90%（25℃）；</p><p>\n									（3）、海拔高度：不超过1000m；</p><p>\n									2、吸油烟机电源插座必须使用有可靠地线的专用插座；</p><p>\n									3、按照说明书安装好吸油烟机，一般安装高度不应低于650mm，尽可能安装在炉灶的正上方；</p><p>\n									4、出风管应尽量的缩短，转弯半径要尽可能的大，这样就能使出风畅顺，抽烟效果好而且噪音减小；</p><p>\n									5、安装在带有止回阀的公共烟道时，必须先检查好止回阀是否能够正常打开工作；</p><p>\n									6、安装烟机时必须保持烟机的水平度，若有倾斜将影响机内油路的流动，可能会出现漏油现象；</p><p>\n									7、安装时尽量使用原配的排烟管、避免急转弯。厨房采取正确的通风方式，能有效地降低噪音，并可在低风速下获得极佳的排油效果；</p><p>\n									8、厨房必须通风，以补充灶具燃烧时所需要的空气，同时防止因缺氧而发生的意外；</p><p>\n									9、厨房的油烟是发生肺部鳞癌和肺腺癌的危害之一，气味降低度测试和延时关机功能确保有效清除厨房残留油；</p><p>\n									10、炖、煮时通常只产生少量味道的水蒸气，调低风速可有效降低噪音；</p><p>\n									11、应在烹饪前或者结束后开启吸油烟机1-2分钟，以获得较好的清除油烟效果；</p><p>\n									12、更换灯泡、清洗吸油烟机前，都应拔掉插头切断电源；</p><p>\n									13、更换灯泡时功率不能超过灯座附近和说明书上的标示的最大值，否则，会使得连接灯座的电线和灯座的温升过高，加速电线绝缘层的老化，造成触电的潜在危险，甚至导致火灾；</p><p>\n									14、按说明书的要求经常清洗油烟机表面的油污和积垢，清洗时请用中性洗涤剂和软布,以免损坏外壳表面或涂层；</p><p>\n									15、油杯中的污油，积存至八分满时，将之倒弃，以免溢出；</p><p>\n									16、严禁非专业人员拆卸产品（油杯除外）；</p>', '', '', '', '吸油烟机应该如何使用和保养', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '27', '2017-10-16', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('19', '13', null, '<p>\n									1、吸油烟机在以下条件下使用：</p><p>\n									（1）、温度：-15℃- +40℃；</p><p>\n									（2）、相对湿度：不大于+90%（25℃）；</p><p>\n									（3）、海拔高度：不超过1000m；</p><p>\n									2、吸油烟机电源插座必须使用有可靠地线的专用插座；</p><p>\n									3、按照说明书安装好吸油烟机，一般安装高度不应低于650mm，尽可能安装在炉灶的正上方；</p><p>\n									4、出风管应尽量的缩短，转弯半径要尽可能的大，这样就能使出风畅顺，抽烟效果好而且噪音减小；</p><p>\n									5、安装在带有止回阀的公共烟道时，必须先检查好止回阀是否能够正常打开工作；</p><p>\n									6、安装烟机时必须保持烟机的水平度，若有倾斜将影响机内油路的流动，可能会出现漏油现象；</p><p>\n									7、安装时尽量使用原配的排烟管、避免急转弯。厨房采取正确的通风方式，能有效地降低噪音，并可在低风速下获得极佳的排油效果；</p><p>\n									8、厨房必须通风，以补充灶具燃烧时所需要的空气，同时防止因缺氧而发生的意外；</p><p>\n									9、厨房的油烟是发生肺部鳞癌和肺腺癌的危害之一，气味降低度测试和延时关机功能确保有效清除厨房残留油；</p><p>\n									10、炖、煮时通常只产生少量味道的水蒸气，调低风速可有效降低噪音；</p><p>\n									11、应在烹饪前或者结束后开启吸油烟机1-2分钟，以获得较好的清除油烟效果；</p><p>\n									12、更换灯泡、清洗吸油烟机前，都应拔掉插头切断电源；</p><p>\n									13、更换灯泡时功率不能超过灯座附近和说明书上的标示的最大值，否则，会使得连接灯座的电线和灯座的温升过高，加速电线绝缘层的老化，造成触电的潜在危险，甚至导致火灾；</p><p>\n									14、按说明书的要求经常清洗油烟机表面的油污和积垢，清洗时请用中性洗涤剂和软布,以免损坏外壳表面或涂层；</p><p>\n									15、油杯中的污油，积存至八分满时，将之倒弃，以免溢出；</p><p>\n									16、严禁非专业人员拆卸产品（油杯除外）；</p>', '', '', '', '吸油烟机应该如何使用和保养', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '27', '2017-10-16', '1', '1', '', '', '', '', '', '', '', '', null);
