INSERT INTO `tb_content_copy` VALUES ('32', '18', null, '<ul class=\" list-paddingleft-2\"><li><p>消费者自收到产品之日起7日内，发生性能故障，消费者可以选择退货、换货或修理（通过网络、电视、电话、邮购等方式购买的商品适用法定的7天无理由退货）。</p></li><li><p>消费者自收到产品之日起15日内，发生性能故障，消费者可选择换货或修理。</p></li><li><p>\n								在三包有效期内，修理两次（指对产品的安全性能故障和使用性能故障进行过两次处理，不包括对其它质量问题的修理），仍不能正常使用的产品（指产品安全性能或使用性能达不到产品标准规定的要求或者不具备大众公认为产品应当具备的使用性能），可凭有效证件免费为消费者调换同规格的产品。</p></li><li><p>\n								在三包有效期内，符合换货条件的，销售者因无同型号同规格产品，消费者不愿调换其他型号、规格产品而要求退货的，销售者应当予以退货；有同型号、同规格产品，消费者不愿调换而要求退货时，销售者应予以退货，对已使用过的产品\n								按规定标准向消费者收取折旧费。</p></li><li><p>以上规定如与国家现行相关法律规定有冲突之处，则以该法律规定为准。</p></li></ul>', '', '', '', '退换货规定', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '42', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('33', '18', null, '<ul class=\" list-paddingleft-2\"><li><p>未送货的，请携带所有购买凭证，直接联系购买的门店办理退货、换货。</p></li><li><p>已送货或已使用的，先联系购买的门店要求退换货，对于人为造成产品、包装物、折旧等，将收取相应的损失费用。</p></li></ul>', '', '', '', '退换货流程', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '43', '', '1', '1', '', '', '', '', '', '', '', '', null);
