INSERT INTO `tb_content_copy` VALUES ('85', '27', null, '<p>1 具备良好的商业信誉与相应资金实力，认同我司品牌经营理念 ;<br/>2 有经营家电或建材品类经验，并有良好的渠道分销及业务推广能力 ;<br/>3 在专业家居建材市场、建材一条街、大型正入住社区有40-80㎡独立店面 ;<br/>4 能贯彻我司品牌专一的原则并能将我司品牌作为唯一或第一项目进行运作 ;<br/>5 热忱欢迎有志创业青年加入我司行列，但需具有强烈的“行商”意识及清晰的经营思路。</p>', '', '', '', '招商加盟', '', 'ATTRACT INVESTMENT', '', '/Uploads/Picture/20171114/5a0aad2de988f.jpg', '', '', '', null, '', '', '', '', '', '', '', '', '103', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('86', '27', null, '', '', '', '', '工程案例', '', 'Engineering', '', '', '', '', '', null, '披荆斩棘，求实创新，历经20多年的探索和实践，德意电器臝得了众多行业合作伙伴的尊重和支持。从单一工程设计到工程咨询、监理、工程总承包，德意通过以咨询、设计、技术方案及项目管理等技术能力与商务资源有机结合，与绿城、万达、金地、荣盛、鲁能、越秀、融侨、佳兆业等知名开发商及高档楼盘建立了紧密的合作。德意，期待通过持续不断的技术创新以及对品质生活的独到见解，让高端时尚的生活气息融入每一户家庭和每一位消费者。', '', '', '', '', '', '', '', '104', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('87', '27', null, '', '', '', '', '招商政策', '', 'Joining policy', '', '', '', '', '', null, '1992年，德意控股集团有限公司从开启创新、创业之路开始，“德意”这个特立于中国厨电行业的名字，和德国精湛工艺、意大利美学品位一起，融入了中国人的厨房生活，向热爱生活的人们敬上最贴近切身所需的厨房电器产品。', '', '', '', '', '', '', '', '105', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('88', '27', null, '', '', '', '', '加盟流程', '', 'Franchise process', '', '', '', '', '', null, '具备良好的商业信誉与相应资金实力，认同我司品牌经营理念 ;有经营家电或建材品类经验，并有良好的渠道分销及业务推广能力 ;在专业家居建材市场、建材一条街、大型正入住社区有40-80㎡独立店面 ;能贯彻我司品牌专一的原则并能将我司品牌作为唯一或第一项目进行运作 ;热忱欢迎有志创业青年加入我司行列，但需具有强烈的“行商”意识及清晰的经营思路。', '', '', '', '', '', '', '', '106', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('89', '27', null, '', '', '', '', '加盟要求', '', 'Franchise requirements', '', '/Uploads/Picture/20171114/5a0ab27414f16.jpg', '', '', '', null, '1.具有独立资格的法人或者自然人。<br>2.具备良好的商业信誉与相应资金实力，认同我司的经营理念和企业文化，品牌意识强；经营我司品牌的意向强烈。<br>3.有家电、建材市场操作经验或市场开拓经验、具备良好的业务推广能力。<br>4.在专业家居建材市场、建材一条街、大型正入住社区有24平以上面积的独立店面 ;<br>5.能贯彻我司品牌专一的原则并能将我司品牌作为唯一或第一项目进行运作 ;<br>需具有强烈的“行商”意识及清晰的经营思路。', '', '', '', '', '', '', '', '107', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('90', '28', null, '', '', '', '', '绿城唐山南湖春晓', '', '', '', '/Uploads/Picture/20171114/5a0abc7d419bb.jpg', '', '', '', null, '南湖春晓项目是由城市高端公离、大型城市公园、主题商业步行街、知名双语幼儿园及小学等物业组成的新兴城市综合体，让业主内外能够感受到品质园区所芾来的尊贵感。', '', '', '', '', '', '', '', '109', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('91', '28', null, '', '', '', '', '绿城宁波皇冠花园', '', '', '', '/Uploads/Picture/20171114/5a0abcabb9276.jpg', '', '', '', null, '皇冠家园是绿城集团打造城市精装公馆及大型集中性商业配套，享国际生活配萁之全，全面收纳成熟繁华.成就新东部中心珍贵的稀缺典菔。', '', '', '', '', '', '', '', '110', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('92', '28', null, '', '', '', '', '万达合肥天鹅湖万达广场', '', '', '', '/Uploads/Picture/20171114/5a0abcefa0392.jpg', '', '', '', null, '合肥天鹅湖万达广场位于市政府中心，周边社区、高档写字楼鱗次栉比，仅一路之隔的项目就有西脚的水墨兰庭.南测的天鹅湖畔、天鹅湾花园、白天鹅商务中心，北侧的恒润花园.科瑞宏源.万达再续合肥商业传奇。', '', '', '', '', '', '', '', '111', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('93', '28', null, '', '', '', '', '万达抚顺万达广场', '', '', '', '/Uploads/Picture/20171114/5a0abd132f703.jpg', '', '', '', null, '万达抚顺是目前抚顺规模最大的商业地产项目，诚邀国内外知名景观设计机构笛东联合参与规划与景观设计。内容包括中心旺铺，河景名宅、甲级设计间，SOHO，精装公寓等业态，以及万达大商业，五星级酒店等瞩目配套设施，是抚顺市最为显赫的繁华中心。', '', '', '', '', '', '', '', '112', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('94', '28', null, '', '', '', '', '佳兆业现代城', '', '', '', '/Uploads/Picture/20171114/5a0abd2f9853d.jpg', '', '', '', null, '佳兆业现代城以创新的设计理念打造LOHO公馆产品，将天井花园.屋顶花园、私家花园组成三重立体花园。', '', '', '', '', '', '', '', '113', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('95', '28', null, '', '', '', '', '佳兆业东戴河', '', '', '', '/Uploads/Picture/20171114/5a0abd4fa4bce.jpg', '', '', '', null, '海费居住区为精装观海公寓，分部错落有致，均无遮控达到户户观海的效果。楼体北侧三部观费电梯使燕山山脉之雄伟气魄尽收眼底.有舒适型一居和享受型两居。每层均有赠送罱观露台和观海平台，送全套家具家电，厨电选用德意电器。', '', '', '', '', '', '', '', '114', '', '1', '1', '', '', '', '', '', '', '', '', null);
