INSERT INTO `tb_content_copy` VALUES ('112', '31', null, '<p>a、品牌沉淀24年，高端厨电前三强</p><p>b、全国知名地产集团、京马等一流企业战略合作</p><p>c、品牌创立至今，斩获荣誉无数</p><p>d、品牌传播权威，央视媒体，高铁冠名，厨电行业唯一入选央视“工匠精神”品牌</p>', '', '', '', '品牌专业优势', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '131', '', '1', '1', '', '', '', '', '', '', '', '', null);
