INSERT INTO `tb_content_copy` VALUES ('114', '31', null, '<p>a、西安交通大学专业合作</p><p>b、多项自主专利见证</p><p>c、德意博士后科研工作站国家级实验室</p><p>d、工业4.0标准的现代化生产基地</p>', '', '', '', '生产研发优势', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '133', '', '1', '1', '', '', '', '', '', '', '', '', null);
