INSERT INTO `tb_content_copy` VALUES ('117', '31', null, '<p>a、开业前：店址选址知道、装修设计支持、开业策划指导</p><p>b、开业后：团队建设咨询、财务管理咨询、终端运营提升系统</p>', '', '', '', '运营支持', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '136', '', '1', '1', '', '', '', '', '', '', '', '', null);
