INSERT INTO `tb_content_copy` VALUES ('120', '1', null, '<p class=\" scrolltop\">1992年，从开启创新、创业之路开始，“德意”这个特立于中国厨电行业的名字，和德国精湛工艺、意大利美学品位一起，融入了中国人的厨房生活，向热爱生活的人们敬上最贴近切身所需的厨房电器产品。对德意而言，重要的不仅仅是科技的创新，更是以完美的设计诠释对品质生活的理解。1998年，研发了国内第一台嵌入式燃气灶具；2002年，创造出中国首款近吸式油烟机；2013年，推出全球首款全直流变频吸油烟机；2015年，打造了全球首款智能穹顶式吸油烟机，开创智能强排油烟机的先河……德意，用诸多厨电行业的革命性“首发”和原创，论证了“产品至上”的初心，彰显了“创见未来”的决心。<br/>20多年来，德意总在第一时间，以先人一步的科技，回应时代变迁中的生活所需，铸就应世而生的产品。让厨房成为每一个家庭最富有创意的地方，是德意永恒不倦的追求。品质厨电，乐享生活。</p>', '', '', '', '品质厨电 乐享生活', '', 'Enjoy life quality hutch electricity', '', '', '', '', '', null, '', '', '', '', '', '', '', '', null, '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('121', '2', null, '<p>\n								德意电器秉承“工匠精神”先后收获了“中国驰名商标”、“中国名牌产品”等多项重量级的荣誉；</p>', '', '', '', '60', '', '', '', '/Uploads/Picture/20171116/5a0d3e27f1360.jpg', '', '', '', null, '拥有60多家的销售公司', '', '', '', '', '', '', '', '139', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('122', '2', null, '<p>在全国进驻千余家国美、苏宁等KA大店并已开设数百家德意标准专卖店,成为广受全球家庭信赖的厨电品牌。</p>', '', '', '', '3000', '', '', '', '/Uploads/Picture/20171116/5a0d3e7a41ac8.jpg', '', '', '', null, '家销售终端的庞大营销网络', '', '', '', '', '', '', '', '140', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('123', '2', null, '<p>让厨房成为每一个家庭最富有创意的地方，是德意永恒不倦的追求。品质厨电，乐享生活。</p>', '', '', '', '1', '', '', '', '/Uploads/Picture/20171116/5a0d3eaa923d8.jpg', '', '', '', null, '先人一步的科技', '', '', '', '', '', '', '', '141', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('124', '2', null, '<p>这个以物联网技术全程数字化管理的工厂，是目前厨电行业内最先进的智能工厂之一。</p>', '', '', '', '7', '', '', '', '/Uploads/Picture/20171116/5a0d3ed33c0f0.jpg', '', '', '', null, '德意斥资7亿,打造智慧工厂', '', '', '', '', '', '', '', '142', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('125', '3', null, '<h1>设计开启未来 一次愉悦的变革</h1><p>\n							自1992年走至2012年，德意二十年的发展道路，从最初两个人的小商店到几千人的工厂，怡如从初临凡间的婴儿成长为俊朗内敛的青年，这是德意坚持不懈探索品牌发展之路的成果，正是德意从渐进的变革中不断寻找新的定位，锐意创新，拼搏进取，更是20年矢志不渝的践行创新设计理念的结晶。</p><p>\n							2011年，对于德意来说是非常具有意义的一年。在这一年德意对品牌战略实施升级，这是对过去积淀的一次升华，也是对未来宽广的一次蓄势。“设计开启未来”成为德意的品牌新战略，基于新战略德意提出“创享非凡”这一全新价值主张，同时对服务进行品牌化运作，推出“360°精诚服务”，更斥巨资聘请国际巨星吴彦祖担任品牌代言人等。德意期待一系列的变革举措，对品牌内涵进行全新注解，立意为更多家庭创造愉悦生活，为德意未来奏出华美乐章。2011\n							,必将是德意里程碑中最闪耀之一。</p><p>\n							无论德意如何变革，总有一份坚守是永不会改变的，那就是对社会、对家庭的责任。德意感谢20年来社会的恩泽与广大消费者的厚爱，正是有如此的期望，德意从未忘记创新理念，不断超越自我,忘却成功而以更非凡的成就回报每一份的挚爱。</p><p>\n							回眸二十载，德意砥砺前行走出了一条写满辉煌的发展之路，也造就了皎皎不群、烨烨生辉的品牌。在即将迎来创立20年周年之际，德意革新了整个品牌战略，这是一次对过往的总结和继承，同时也意味着一个新的起点。站在全新的起点上，德意正以更高远的眼光与志向，为构建中国厨卫行业第一高端强势品牌的目标而拼搏奋进，我们期待下—个20年的辉煌！</p>', '', '', '', '浙江德意厨具有限公司董事长', '', '', '', '/Uploads/Picture/20171117/5a0ed8544d548.jpg', '/Uploads/Picture/20171116/5a0d438933c20.jpg', '/Uploads/Picture/20171116/5a0d43f9203a0.jpg', '', null, '自1992年走至2012年，德意二十年的发展道路，从最初两个人的小商店到几千人的工厂，怡如从初临凡间的婴儿成长为俊朗内敛的青年，这是德意坚持不懈探索品牌发展之路的成果，正是德意从渐进的变革中不断寻找新的定位，锐意创新，拼搏进取，更是20年矢志不渝的践行创新设计理念的结晶。', '', '', '', '', '', '', '', null, '', '1', '1', '', '', '', '', '', '', '', '', null);
