INSERT INTO `tb_content_copy` VALUES ('149', '7', null, '', '', '', '', '金地集团', '', '', '', '/Uploads/Picture/20171116/5a0d5433280a0.png', '', '', '', null, '金地集团以“科学筑家”为使命，29年来秉持“引领人本生活”的产品理念，为中国超过35万户家庭，提供标准化、系列化的住宅与社区商业产品。', '1988', '', '', '', '', '', '', '166', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('150', '7', null, '', '', '', '', '荣盛集团', '', '', '', '/Uploads/Picture/20171116/5a0d547423668.png', '', '', '', null, '荣盛控股股份有限公司是一家跨地区多元化经营、快速成长的投资控股集团公司。', '2005', '', '', '', '', '', '', '167', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('151', '7', null, '', '', '', '', '鲁能集团', '', '', '', '/Uploads/Picture/20171116/5a0d5497bc7a0.png', '', '', '', null, '鲁能集团有限公司是国家电网公司全资子公司，核心业务聚焦地产、能源两大板块，致力于成为公众、专业、优质、领先的绿色地产发展商和绿色能源投资运营商。', '2002', '', '', '', '', '', '', '168', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('152', '7', null, '', '', '', '', '融侨集团', '', '', '', '/Uploads/Picture/20171116/5a0d54b45e3d0.png', '', '', '', null, '一家以房地产开发为核心涉及港口开发、商业、酒店、物业管理、教育、农业旅游、温泉开发、医疗等产业的外商投资企业。', '1989', '', '', '', '', '', '', '169', '', '1', '1', '', '', '', '', '', '', '', '', null);
