INSERT INTO `tb_content_copy` VALUES ('204', '41', null, '<p>1992年，从开启创新、创业之路开始，“德意”这个名字，始终向德国精湛工艺、意大利美学品位看齐，融入中国人的厨房生活，向热爱生活的人们敬上贴近切身所需的厨房电器产品。</p><p>1998年，敏锐洞察人们生活细节的德意断然抛弃了当时热销的传统台式灶，研发了嵌入式玻璃灶，一时间将中国无数家庭送入了美观、易清洁的新厨房时代。</p><p>2002年，德意更赋创造性地推出近吸式油烟机，由于其设计与功能的融合，短时间内便与时下主流的欧式机平分秋色，更引得行业大佬们纷纷跟进，再一次获得众多消费者的认可。</p><p>2011年，DE&amp;E新品牌发布，德意启动“设计开启未来”新品牌战略和“创享非凡”的顾客价值战略。</p>', '<p>2013年，全直流变频吸油烟机又在德意横空出世， 预示着吸油烟机“变频滑触”时代的到来，科技与生活的碰撞与融合再一次紧密相连。</p><p>2015年，德意发布了“穹顶”系列吸油烟机，获得中国家电行业年度大奖——爱普兰产品奖，创新吸油烟机新品类。</p>', '', '', '关于我们', '', '', '', '/Uploads/Picture/20171208/2017120821514516905.jpg', '', '', '', null, '', '', '', '', '', '', '<p>25年来，德意以始终专注的精神，坚守“正派、务实、创新、进取”的企业核心价值观，帮助众多追求顶尖烹饪体验的家庭实现了高品质生活享受。</p><p>今天，德意愿以创新科技和对生活的热爱，把高端时尚的生活享受传递至每一个家庭、每一个你。</p>', '', '233', '', '1', '1', '', '', '', '', '', '', '', '', null);
