INSERT INTO `tb_content_copy` VALUES ('218', '54', null, '<p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(1).反对宪法所确定的基本原则的；</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(2).危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(3).损害国家荣誉和利益的；</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(4).煽动民族仇恨、民族歧视，破坏民族团结的；</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(5).破坏国家宗教政策，宣扬邪教和封建迷信的；</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(6).散布谣言，扰乱社会秩序，破坏社会稳定的；</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(7).散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(8).侮辱或者诽谤他人，侵害他人合法权益的；</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(9).含有法律、行政法规禁止的其他内容的。</p><p><br/></p>', '', '', '', '3．用户在本商城上交易平台上不得发布下列违法信息：', '', '', '', '/Uploads/Picture/20171209/2017120915241817519.png', '', '', '', null, '2017-12-09', '', '', '', '', '', '', '', '269', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('219', '54', null, '<p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">用户同意：</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(1).提供及时、详尽及准确的个人资料。</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(2).同意接收来自本商城的信息。</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(3).不断更新注册资料，符合及时、详尽准确的要求。所有原始键入的资料将引用为注册资料。</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(4).本商城不公开用户的姓名、地址、电子邮箱和笔名，以下情况除外：</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">（a）用户授权本商城透露这些信息。</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">（b）相应的法律及程序要求本商城提供用户的个人资料。如果用户提供的资料包含有不正确的信息，本商城保留结束用户使用本商城信息服务资格的权利。</p><p><br/></p>', '', '', '', '4．有关个人资料', '', '', '', '/Uploads/Picture/20171209/2017120915244783407.png', '', '', '', null, '2017-12-09', '', '', '', '', '', '', '', '270', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('220', '54', null, '<p>5.在注册时应当选择稳定性及安全性相对较好的电子邮箱，并且同意接受并阅读本商城发往用户的各类电子邮件。如用户未及时从自己的电子邮箱接受电子邮件或因用户电子邮箱或用户电子邮件接收及阅读程序本身的问题使电子邮件无法正常接收或阅读的，只要本商城成功发送了电子邮件，应当视为用户已经接收到相关的电子邮件。电子邮件在发信服务器上所记录的发出时间视为送达时间。</p>', '', '', '', '', '', '', '', '/Uploads/Picture/20171209/2017120915252464734.png', '', '', '', null, '2017-12-09', '', '', '', '', '', '', '', '271', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('221', '54', null, '<p><span style=\"color: rgb(128, 130, 133); font-family: 微软雅黑, Arial; font-size: 13px; letter-spacing: 1px; background-color: rgb(255, 255, 255);\">本商城有权在必要时修改服务条款，本商城服务条款一旦发生变动，将会在重要页面上提示修改内容。如果不同意所改动的内容，用户可以主动取消获得的本商城信息服务。如果用户继续享用本商城信息服务，则视为接受服务条款的变动。本商城保留随时修改或中断服务而不需通知用户的权利。本商城行使修改或中断服务的权利，不需对用户或第三方负责。</span></p>', '', '', '', '6．服务条款的修改', '', '', '', '/Uploads/Picture/20171209/2017120915255421831.png', '', '', '', null, '', '', '', '', '', '', '', '', '272', '', '1', '1', '', '', '', '', '', '', '', '', null);
