INSERT INTO `tb_content_copy` VALUES ('223', '54', null, '<p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">尊重用户个人隐私是本商城的一项基本政策。所以，本商城一定不会在未经合法用户授权时公开、编辑或透露其注册资料及保存在本商城中的非公开内容，除非有法律许可要求或本商城在诚信的基础上认为透露这些信息在以下四种情况是必要的：</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(1) 遵守有关法律规定，遵从本商城合法服务程序。</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(2) 保持维护本商城的商标所有权。</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(3) 在紧急情况下竭力维护用户个人和社会大众的隐私安全。</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(4)符合其他相关的要求。</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">本商城保留发布会员人口分析资询的权利。</p><p><br/></p>', '', '', '', '7．用户隐私制度', '', '', '', '/Uploads/Picture/20171209/2017120915261536154.png', '', '', '', null, '2017-12-09', '', '', '', '', '', '', '', '274', '', '1', '1', '', '', '', '', '', '', '', '', null);
