INSERT INTO `tb_content_copy` VALUES ('233', '54', null, '<p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">用户必须遵循：</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(1) 使用信息服务不作非法用途。</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(2) 不干扰或混乱网络服务。</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(3) 遵守所有使用服务的网络协议、规定、程序和惯例。用户的行为准则是以因特网法规，政策、程序和惯例为根据的。</p><p><br/></p>', '', '', '', '12．用户管理', '', '', '', '/Uploads/Picture/20171209/2017120915365759775.png', '', '', '', null, '2017-12-09', '', '', '', '', '', '', '', '284', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('215', '55', null, '<p>如果您在本商城访问或购物，您便接受了以下条件。</p>', '', '', '', '商城使用条款', '', '', '', '/Uploads/Picture/20171209/2017120915202148953.png', '', '', '', null, '2017-12-09', '', '', '', '', '', '', '', '252', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('234', '54', null, '<p><span style=\"color: rgb(128, 130, 133); font-family: 微软雅黑, Arial; font-size: 13px; letter-spacing: 1px; background-color: rgb(255, 255, 255);\">用户同意保障和维护本商城全体成员的利益，负责支付由用户使用超出服务范围引起的律师费用，违反服务条款的损害补偿费用，其它人使用用户的电脑、帐号和其它知识产权的追索费。</span></p>', '', '', '', '13．保障', '', '', '', '/Uploads/Picture/20171209/2017120915371555085.png', '', '', '', null, '2017-12-09', '', '', '', '', '', '', '', '285', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('235', '54', null, '<p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">用户或本商城可随时根据实际情况中断一项或多项服务。本商城不需对任何个人或第三方负责而随时中断服务。用户若反对任何服务条款的建议或对后来的条款修改有异议，或对本商城服务不满，用户可以行使如下权利：</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(1) 不再使用本商城信息服务。</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">(2) 通知本商城停止对该用户的服务。</p><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(128, 130, 133); line-height: 25px; font-size: 13px; font-family: 微软雅黑, Arial; letter-spacing: 1px; white-space: normal; background-color: rgb(255, 255, 255);\">结束用户服务后，用户使用本商城服务的权利马上中止。从那时起，用户没有权利，本商城也没有义务传送任何未处理的信息或未完成的服务给用户或第三方。</p><p><br/></p>', '', '', '', '14．结束服务', '', '', '', '/Uploads/Picture/20171209/2017120915373290734.png', '', '', '', null, '', '', '', '', '', '', '', '', '286', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('236', '54', null, '<p><span style=\"color: rgb(128, 130, 133); font-family: 微软雅黑, Arial; font-size: 13px; letter-spacing: 1px; background-color: rgb(255, 255, 255);\">所有发给用户的通告都可通过重要页面的公告或电子邮件或常规的信件传送。服务条款的修改、服务变更、或其它重要事件的通告都会以此形式进行。</span></p>', '', '', '', '15．通告', '', '', '', '/Uploads/Picture/20171209/2017120915375434997.png', '', '', '', null, '2017-12-09', '', '', '', '', '', '', '', '287', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('237', '54', null, '<p><span style=\"color: rgb(128, 130, 133); font-family: 微软雅黑, Arial; font-size: 13px; letter-spacing: 1px; background-color: rgb(255, 255, 255);\">本商城定义的信息内容包括：文字、软件、声音、相片、录象、图表；在广告中全部内容；本商城为用户提供的其它信息。所有这些内容受版权、商标、标签和其它财产所有权法律的保护。所以，用户只能在本商城和广告商授权下才能使用这些内容，而不能擅自复制、再造这些内容、或创造与内容有关的派生产品。</span></p>', '', '', '', '16．信息内容的所有权', '', '', '', '/Uploads/Picture/20171209/2017120915381392559.png', '', '', '', null, '2017-12-09', '', '', '', '', '', '', '', '288', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('238', '54', null, '<p><span style=\"color: rgb(128, 130, 133); font-family: 微软雅黑, Arial; font-size: 13px; letter-spacing: 1px; background-color: rgb(255, 255, 255);\">本商城信息服务条款要与中华人民共和国的法律解释一致。用户和本商城一致同意服从本商城所在地有管辖权的法院管辖。如发生本商城服务条款与中华人民共和国法律相抵触时，则这些条款将完全按法律规定重新解释，而其它条款则依旧保持对用户的约束力。</span></p>', '', '', '', '17．法律', '', '', '', '/Uploads/Picture/20171209/2017120915382930162.png', '', '', '', null, '2017-12-09', '', '', '', '', '', '', '', '289', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('239', '55', null, '<p>本商城上的所有内容诸如文字、图表、标识、按钮图标、图像、声音文件片段、数字下载、数据编辑和软件都是本商城提供者的财产，受中国和国际版权法的保护。本商城上所有内容的汇编是本商城的排他财产，受中国和国际版权法的保护。本商城上所使用的所有软件都是本商城或其关联公司或其软件供应商的财产，受中国和国际版权法的保护。</p>', '', '', '', '版权', '', '', '', '/Uploads/Picture/20171209/2017120915393599839.png', '', '', '', null, '2017-12-09 ', '', '', '', '', '', '', '', '278', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('240', '55', null, '<p><span style=\"color: rgb(128, 130, 133); font-family: 微软雅黑, Arial; font-size: 13px; letter-spacing: 1px; background-color: rgb(255, 255, 255);\">本商城授予您有限的许可进入和个人使用本商城，未经本商城的明确书面同意不许下载（除了页面缓存）或修改商城或其任何部分。这一许可不包括对本商城或其内容的转售或商业利用、任何收集和利用产品目录、说明和价格、任何对本商城或其内容的衍生利用、任何为其他商业利益而下载或拷贝账户信息或使用任何数据采集、 robots或类似的数据收集和摘录工具。未经本商城的书面许可，严禁对本商城的内容进行系统获取以直接或间接创建或编辑文集、汇编、数据库或人名地址录（无论是否通过robots、spiders、自动仪器或手工操作）。另外，严禁为任何未经本使用条件明确允许的目的而使用本商城上的内容和材料。 未经本商城明确书面同意，不得以任何商业目的对本商城或其任何部分进行复制、复印、仿造、出售、转售、访问、或以其他方式加以利用。未经本商城明确书面同意，您不得用设计或运用设计技巧把本商城或其关联公司的商标、标识或其他专有信息（包括图像、文字、网页设计或形式）据为己有。未经本商城明确书面同意，您不可以meta tags或任何其他“隐藏文本”方式使用本商城的名字和商标。任何未经授权的使用都会终止本商城所授予的允许或许可。您被授予有限的、可撤销的和非独家的权利建立链接到本商城主页的超链接，只要这个链接不以虚假、误导、贬毁或其他侵犯性方式描写本商城、其关联公司或它们的产品和服务。</span></p>', '', '', '', '许可和商城进入', '', '', '', '/Uploads/Picture/20171209/2017120915395160360.png', '', '', '', null, '2017-12-09', '', '', '', '', '', '', '', '279', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('241', '55', null, '<p><span style=\"color: rgb(128, 130, 133); font-family: 微软雅黑, Arial; font-size: 13px; letter-spacing: 1px; background-color: rgb(255, 255, 255);\">访问者可以张贴评论、意见及其他内容，以及提出建议、主意、意见、问题或其他信息，只要内容不是非法、淫秽、威胁、诽谤、侵犯隐私、侵犯知识产权或以其他形式对第三者构成伤害或侵犯或令公众讨厌，也不包含软件病毒、政治宣传、商业招揽、连锁信、大宗邮件或任何形式的“垃圾邮件”。您不可以使用虚假的电子邮件地址、冒充任何他人或实体或以其它方式对卡片或其他内容的来源进行误导。本商城保留清除或编辑这些内容的权利（但非义务），但不对所张贴的内容进行经常性的审查。如果您确实张贴了内容或提交了材料，除非我们有相反指示，您授予本商城及其关联公司非排他的、免费的、永久的、不可撤销的和完全的再许可权而在全世界范围内任何媒体上使用、复制、修改、改写、出版、翻译、创作衍生作品、分发和展示这样的内容。您授予本商城及其关联公司和被转许可人使用您所提交的与这些内容有关的名字的权利，如果他们选择这样做的话。您声明并担保您拥有或以其它方式控制您所张贴内容的权利，内容是准确的，对您所提供内容的使用不违反本政策并不会对任何人和实体造成伤害。您声明并保证对于因您所提供的内容引起的对本商城或其关联公司损害进行赔偿。本商城有权监控和编辑或清除任何活动或内容。本商城对您或任何第三方所张贴的内容不承担责任。</span></p>', '', '', '', '评论、意见、消息和其他内容', '', '', '', '/Uploads/Picture/20171209/2017120915401340878.png', '', '', '', null, '', '', '', '', '', '', '', '', '280', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('242', '55', null, '<p><span style=\"color: rgb(128, 130, 133); font-family: 微软雅黑, Arial; font-size: 13px; letter-spacing: 1px; background-color: rgb(255, 255, 255);\">本商城及其关联公司努力使产品说明尽可能准确。不过，由于实际条件限制，本商城并不保证产品说明或本商城上的其他内容是准确的、完整的、可靠的、最新的或无任何错误的。</span></p>', '', '', '', '产品说明', '', '', '', '/Uploads/Picture/20171209/2017120915403190647.png', '', '', '', null, '2017-12-09', '', '', '', '', '', '', '', '281', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('243', '55', null, '<p><span style=\"color: rgb(128, 130, 133); font-family: 微软雅黑, Arial; font-size: 13px; letter-spacing: 1px; background-color: rgb(255, 255, 255);\">当您访问本商城或用商城客服在线客服、QQ给我们发送电子邮件时，我们默认您同意以任何电子方式接受我们的信息。我们将用电子联系方式或通过电话的方式与您进行联系。您同意我们用电子方式提供给您的所有协议、通知、披露和其他信息是符合此类通讯必须是书面形式的法定要求的。如果并且当本商城能够证明以电子形式的信息已经发送给您或者在本商城张贴这样的通知，将被视为您已收到所有协议、声明、披露和其他信息。</span></p>', '', '', '', '电子通讯', '', '', '', '/Uploads/Picture/20171209/2017120915405095304.png', '', '', '', null, '2017-12-09', '', '', '', '', '', '', '', '282', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('252', '51', null, '', '', '', '', '购物流程', '', '', '', '/Uploads/Picture/20171209/2017120915422392135.png', '', '', '', null, '2017-12-09', '', '', '', '', '', '', '', '275', '2017-12-09', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('304', '71', null, '<h5>卡券类产品Q&amp;A：</h5><p>（1）兑换时间：卡券类产品数量有限兑完即止，会按照标题显示时间补充库存，如有兑换需要请注意时间。</p><p>（2）兑换要求：卡券类产品库存有限，单笔订单仅限兑换一张，感谢您的理解。</p><p>（3）注意问题：务必确保所留的电话号码是准确的。</p><p>①卡券类别：卡券类产品分为实体卡和电子卡两种，页面均有标注，电子卡为虚拟产品，无物流信息展现。</p><p>②拍前必读：由于电子卡的特殊产品属性，拍下前请仔细核对您的手机号，若需要修改手机号，请联系在线客服，由于顾客号码填写错误导致的损失积分商城概不承担，感谢理解。</p><p>③话费卡兑换须知：话费卡在兑换成功后2个工作日内到账，按每次100元分批次充值到账，充值金额超过100元的订单若有部分金额延迟到账属于正常现象，最晚到账时间不会超过2个工作日。</p><p>④京东卡等电子充值卡兑换后通过卡号和密码激活，卡密会以短信形式发送到您的手机号，拍下前请仔细核对您的手机号，需要修改手机号，请联系在线客服。</p>', '', '', '', '德意积分商城兑换须知', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '321', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('272', '60', null, '<p>本商城提供网银付款方式，请在下单时选择正确的银联卡，感谢支持。</p>', '', '', '', '网银支付', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '289', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('281', '60', null, '<p>本商城支持支付宝交易付款，接收支付宝的相关交易管理，请放心购买。</p>', '', '', '', '支付宝支付', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '298', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('282', '60', null, '<p>本商城支持微信交易付款，接收微信的相关交易管理，请放心购买。</p>', '', '', '', '微信支付', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '299', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('273', '61', null, '<p>本商城产品配送，首选国家“AAAAA”级物流企业——德邦物流（个别偏远地区除外），快速高效、便捷及时、安全可靠，确保顾客购买无忧！如有疑问，请联系客服进行咨询。</p>', '', '', '', '配送方式', '', '', '', '', '', '', '', null, '2015-08-10', '', '', '', '', '', '', '', '290', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('274', '62', null, '<h4>目前本商城支持三种验货方式</h4><p>1、如您收到的产品包装箱已经破损，请跟快递人员一起开箱验货；</p><p>2、如产品包装箱完好，可以直接签收，待安装技师上门安装时一起开箱验货；</p><p>3、在您需要时，自行开箱验货，但建议保留相关证据；</p><p>\n										无论哪种验货方式，如果发现物流途损或质量问题，请及时联系我们，德意会尽快为您解决问题，直至您满意。同时建议您在安装完成后，将包装箱折叠保留3个月以上，如后期涉及退换货等售后问题，可以直接使用原包装，避免您个人承担二次包装费。</p>', '', '', '', '验货签收', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '291', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('275', '63', null, '<p>您购买的产品将由宁波总部为您发出。一般情况下：</p><p>1） 江浙沪地区1-3天到货；</p><p>2） 省会及地级市3-5天到货；</p><p>3） 县城5-7天到货；</p><p>4） 个别偏远地区7-15天到货；</p><p>以上为预计时间，如遇恶劣天气，或物流高峰期，会产生一定延迟，敬请谅解！</p>', '', '', '', '1、配送时间', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '292', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('284', '63', null, '<p>德意提供送货上门服务，请您务必确认好收货地址，以免无人签收。由于包装较大，快递送货上门时，希望您可以帮忙搭把手。如果快递的服务不能让您满意，请拨打9510-5898，我们会竭尽全力为您解决问题！</p>', '', '', '', '2、送货上门', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '301', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('285', '63', null, '<p>快递员会在派送前与您提前联系，并选择您方便的时间段进行派送，避免出现无人签收的状况。</p>', '', '', '', '3、送前联系', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '302', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('286', '63', null, '<p>北京地区货到付款线下机订单，支付方式仅限于支付宝/微信付款。</p><p>其他地区货到付款订单，支付方式仅限于现金/刷卡。</p><p>发货前将电话与您联系确认。</p>', '', '', '', '4、货到付款', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '303', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('276', '64', null, '<table class=\"table brand_tab\"><tbody><tr style=\"background: #ddd;\" class=\"firstRow\"><th>地点</th><th>配送点</th><th>地点</th><th>配送点</th></tr><tr><td>邵阳市</td><td>常德办事处</td><td>长沙-宁乡县、浏阳市</td><td>长沙办事处</td></tr><tr><td>河北张家口市区</td><td>大同办事处</td><td>长沙-宁乡县、浏阳市</td><td>长沙办事处</td></tr><tr><td>河北张家口市区</td><td>大同办事处</td><td>长沙-宁乡县、浏阳市</td><td>长沙办事处</td></tr><tr><td>河北张家口市区</td><td>大同办事处</td><td>长沙-宁乡县、浏阳市</td><td>长沙办事处</td></tr><tr><td>河北张家口市区</td><td>大同办事处</td><td>长沙-宁乡县、浏阳市</td><td>长沙办事处</td></tr></tbody></table>', '', '', '', '配送范围', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '293', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('277', '65', null, '<table border=\"1\"><tbody><tr class=\"firstRow\"><th rowspan=\"2\">项目产品</th><th colspan=\"2\">包修期限</th><th rowspan=\"2\">服务承诺</th></tr><tr><th>整机</th><th>特别说明</th></tr><tr><td>油烟机</td><td>五年</td><td>电机终身包修；白炽灯泡包修一年</td><td>免费预埋烟管、免费安装、终身上门维修</td></tr><tr><td>灶具</td><td>一年</td><td>阀体包修三年</td><td>免费安装；终身上门维修</td></tr><tr><td>消毒柜</td><td>一年</td><td>电脑板、控制板包修三年</td><td>免费安装；终身上门维修</td></tr><tr><td>烤箱</td><td>一年</td><td>电源板、控制板、加热管、循环电机、冷却电机包修三年</td><td>免费安装；终身上门维修</td></tr><tr><td>微波炉</td><td>一年</td><td>电脑版、磁控管、变压器包修三年</td><td>免费安装；终身上门维修</td></tr><tr><td>蒸箱</td><td>一年</td><td>电子开关、加热盘、电脑板包修三年</td><td>免费安装；终身上门维修</td></tr></tbody></table>', '', '', '', '服务政策', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '295', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('278', '65', null, '<p>1、退款操作</p><p>请联系客服申请退款；</p><p>2、退款周期</p><p>提交退款申请后15个工作日内；</p><p>3、退款账户</p><p>支付宝支付用户款项返回原有账号，其他付款方式请与工作人员联系，提供退款账户。</p>', '', '', '', '退款说明', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '296', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('279', '65', null, '<p>收到货后，请拨打德意全国统一服务热线95105898进行预约安装，有服务网点城市提供免费安装服务（暂不支持墙面开孔、做支架、拆旧机、标配外零部件等项目），个别偏远地区没有服务网点城市需自行安装，敬请谅解。</p>', '', '', '', '安装与维修', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '297', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('280', '65', null, '<p>我们将细心回答您所提出的任何与德意产品及服务相关的问题。</p><p>全国统一服务热线:95105898</p>', '', '', '', '咨询与投诉', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '298', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('283', '60', null, '<p>请在48小时内完成付款， 超过时间系统将自动取消订单，请您及时付款以免影响收货周期。</p>', '', '', '', '付款说明', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '300', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('287', '66', null, '<p>1、客户在收到货物时当面在送货员面前拆包检查，发现货物有质量问题的；</p><p>2、实际收到货物与商城上描述的有很大的出入的。</p><p>3、换货流程：客户当面要求送货人员退回货物，然后与我们联系。我们会为您重新发货，货物到达时间顺延。</p>', '', '', '', '符合以下条件，可以要求换货', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '304', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('288', '66', null, '<p>1、客户收到货物后七天之内，发现商品有明显的制造缺陷的；</p><p>2、货物经过一次换货但仍然存在质量问题的；</p><p>3、退货流程：客户在收到货物后七天内与我们联系，我们会在五个工作日内将货款返还。</p>', '', '', '', '符合以下条件，可以要求退货', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '305', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('289', '66', null, '<p>1、货物出现破损，但没有在收货时当场要求送货人员换货的；</p><p>2、超过退换货期限的退换货要求；</p><p>3、退换货物不全或者外观受损；</p><p>4、客户发货单据丢失或者不全；</p><p>5、产品并非我们提供；</p><p>6、货物本身不存在质量问题的。</p>', '', '', '', '以下情况，我们有权拒绝客户的退换货要求', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '306', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('290', '67', null, '<p>请联系9510-5898申请退换货。</p>', '', '', '', '退款操作', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '307', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('291', '67', null, '<p>提交退货申请后，7到15个工作日内到账。</p>', '', '', '', '退款周期', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '308', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('292', '67', null, '<p>3个月内直接通过关联支付宝链接支付的用户款项返回原有账户；超出三个月外支付宝支付用户以及通过支付宝转账或其他付款方式支付的用户款项需要用户提供退款账户，银行卡退款账户需提供：银行卡号+该卡号实名认证人姓名+银行所在省市区域+具体支行信息；支付宝退款账号需提供：支付宝账号+实名认证姓名；联系工作人员退款。</p>', '', '', '', '退款账户', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '309', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('293', '68', null, '<p>首先您可以通过浏览商城了解商品。看到您满意的商品您可以直接在我们的商城上实现订购。您也可以和我们商城的客服人员联系订购。</p>', '', '', '', '如何订购商品？', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '310', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('294', '68', null, '<p>1、德意集团官方商城，原厂直销，品质保证；</p><p>2、多种付款方式以及物流的全国配送；</p><p>3、人性化的退换货事宜；</p><p>4、体贴入微的会员积分计划；</p><p>5、我们有正规大型实体店，品种齐全，安全、信誉有保障；</p>', '', '', '', '请告诉我在这里购物的理由好吗？', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '311', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('295', '68', null, '<p>目前商城查找的都是可以订购的，但是必须是仓库中有库存的产品我们才可以与您确认。部分热销产品也可以通过我们的商城做一个预约，等到货品到后，我们会立即通过电话或者电子邮件的方式通知您来订购。</p>', '', '', '', '所有的产品都能够在商城上购买?', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '312', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('296', '68', null, '<p>1、只有注册用户才可以在网上进行订购，享受优惠的价格。</p><p>2、只有注册用户才可以登录【会员中心】，使用更多的会员购物功能，管理自己的资料。</p><p>3、只有注册用户才可以在网上给其他注册的朋友留言。</p><p>4、只有注册用户才有机会获取我们赠送的礼品。</p>', '', '', '', '为什么要注册会员？', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '313', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('297', '68', null, '<p>为了保护客户利益，我们无法看到您的密码。当您忘记密码时，请登录注册页面，点击&quot;忘记密码&quot;，系统会自动将您的密码通过email告诉您，您可以登录【会员中心】去更改密码，以确保您的利益，或者联系我们的客服，提供证据，我们将24小时之内解决您的问题。</p>', '', '', '', '忘记了密码怎么办？', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '314', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('298', '68', null, '<p>积分的高低只反映您对我们的关注和支持程度。我们的积分是通过订购商品产生的。对于高积分的客户我们会有一定的奖励，如积分兑换商品、积分抵扣价格、赠送商品，以更优惠的价格购买商品等，以此回馈广大顾客。</p>', '', '', '', '积分是怎么回事？有什么作用？', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '315', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('299', '69', null, '<p>按照订单中商品金额或者商品可得积分，订单状态为已发货后可获得相应的积分 。</p>', '', '', '', '积分增加', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '316', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('300', '69', null, '<p>会员可进入【会员中心】——【会员信息】中查看自己的积分情况。</p>', '', '', '', '积分查询', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '317', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('301', '69', null, '<p>积分长期有效。除非本商城取消积分奖励计划。如果取消积分奖励计划我们会提前通知广大用户。</p>', '', '', '', '积分有效期', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '318', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('302', '69', null, '<p>本积分奖励计划由本商城制定并保留所有的解释权和修改权。修改以商城公布为准，不做另行通知。</p>', '', '', '', '积分说明', '', '', '', '', '', '', '', null, '2017-12-11', '', '', '', '', '', '', '', '319', '', '1', '1', '', '', '', '', '', '', '', '', null);
INSERT INTO `tb_content_copy` VALUES ('305', '72', null, '<p>\n							德意积分商城至2014年10月上线以来，已服务过1W+用户（截止2017年9月）；积累了丰富的服务经验，将继续致力于提供“五心”服务。如下要点，您使用积分前一定要Get的，让您的积分权益发挥到最大。</p><h5>积分：</h5><p>德意积分是德意诚挚回报用户的一种方式，通过参与德意商城、生活家、我陪孩子读经典、德意官方微信、老友技等平台的活动，按照其活动规则获得相应积分。</p><h5>积分使用：</h5><p>积分在可以再积分商城（http://unohacha.hk:9090/case/dysc5/integral.html）兑换各类商品， 也可使用积分参与抽奖或各平台策划的活动。</p><h5>积分获取：</h5><p>参与德意策划的各类活动，如在德意商城上购物、评价、再如参与我陪孩子读经典、德意生活家、老友技、德意官微组织的活动，根据相应活动规则获相应积分。</p><h5>积分时效：</h5><p>1) 积分到账时间：完成相应动作后，积分将实时到账；各平台积分汇总到积分商城账号有5个小时以内的延时，请您耐心等候。</p><p>2) 积分时效：积分时效为12个月，过期该积分将会自动衰减。请您务必注意积分时效，在时效内更好的行使您的积分权益。</p>', '', '', '', '德意积分商城要点', '', '', '', '', '', '', '', null, '', '', '', '', '', '', '', '', '322', '', '1', '1', '', '', '', '', '', '', '', '', null);
