INSERT INTO `tb_job` VALUES ('1', '2', '', '油烟机研发工程师', '', '', '28岁以上', '2', '杭州', '', '', '', '', '', '', '', '本科及以上', '', '', '', '5人', '<p>1.年龄要求：28岁以上； <br/>\n										2.学历和专业：本科及以上学历，质量管理相关专业优先考虑；<br/> \n										3.工作经验：三年及以上制造业质量管理经验，丰富的现场品质管理经验；<br/> \n										4.工作技能：熟悉ISO9000/16949质量管理体系，能够编制质量管理体系文件；熟练使用七大质量管理工具，FMEA;六西格玛绿带/黑带优先考虑；<br/> \n										5.其他：灵活应变的处事能力，有较强的沟通、协调、教育、组织能力。<br/></p>', '', '<p>1.负责产品质量管理、质量管理体系的研究和控制；<br/>\n										2.组织产品质量策划,编制质量策划的输出文件，编制质量管理相关的程序/流程/制度文件，评审发布；<br/>\n										3.负责组织编制原材料/部件/半成品/成品检验标准，检验作业指导书（SIP），检验设备/工具操作规程，发布、培训及监督执行，并持续完善；<br/>\n										4.负责质量管理数据的系统性策划，并对质量数据进行统计/分析，提出改善要求，并推进各单位进行产品质量的持续改善；<br/>\n										5.负责跟进/指导各工程师质量异常处理进度，时效，确保质量异常的及时有效处理；<br/>\n										6.负责批量生产过程、客诉等产品重大品质异常时，组织评审并通报跟进处理进度；<br/>\n										7.负责组织策划公司员工质量意识的培训，质量活动的策划及实施；<br/></p>', '', '1', '0000-00-00', '2017-11-12', '1', '', '1', '流体力学、空气动力学、机械制造、自动化、电气工程、材料', '', '', '', '', '', '', '', '', '');
