INSERT INTO `tb_news` VALUES ('5', '2', '王者归来 | 德意智能强排油烟机V8全球发布', '', '', '', '<p>\n											3月18日，一场盛大的“王者归来——德意智能强排油烟机V8全球发布会”在杭州水博园大酒店隆重举行。</p><p>\n											中国五金制品协会、浙江省五金制品协会、浙江省燃气具和厨电厨具行业协会、浙江省家用电器协会领导、苏宁和京东等渠道嘉宾、德意战略合作伙伴、专家教授、德意全国总经销以及房天下、新浪、腾讯、杭州电视台等近百家媒体共同见证了V8的华彩揭幕。</p>', '', '', '', '', '', '', '', '', '', '', '', '<p>引言：2017年4月8日上午，位于杭州萧山的德意电器全新智慧工厂正式建成启用，标志着德意从传统制造企业，完成信息化和智能化的转型升级，走上竞逐国际一流厨电企业的辉煌大道。</p><p style=\"text-align: center;\"><img src=\"http://deyi.unohacha.com/Public/Admin/Ueditor/php/../../../../Uploads/upload_admin/20171113/1510557256580412.jpg\" title=\"news_in1.jpg\"/></p><p>4月8日注定是德意史册中具有划时代意义的日子，德意集团董事长高德康和全体员工一起，共同见证了智慧工厂启用。高德康董事长与高层主管在现场进行了揭幕仪式，而后就德意智慧新工厂的正式启用发表演讲。高董事长表示耗资超七亿的新工厂能在今天正式投入使用，离不开政府和社会的支持，更离不开建设队伍的不懈努力，德意电器也将在这样一个高度智能化、规模化、品牌化的新工厂里缔造新的厨电传奇。\n										同时，高董事长也勉励全体员工百尺竿头更进一步，在新的环境中继续保持优良的工作作风，并不断完善自我、提升自我，在秉承匠心与借助智能的双效作用力下，与德意实现共同进步。</p><p style=\"text-align: center;\"><img src=\"http://deyi.unohacha.com/Public/Admin/Ueditor/php/../../../../Uploads/upload_admin/20171113/1510557286109003.jpg\" style=\"float:none;\" title=\"news_in2.jpg\"/></p><p style=\"text-align: center;\"><img src=\"http://deyi.unohacha.com/Public/Admin/Ueditor/php/../../../../Uploads/upload_admin/20171113/1510557287202550.jpg\" style=\"float:none;\" title=\"news_in3.jpg\"/></p><p>德意的新工厂是一个现代化的智慧工厂，物联网技术得到深度应用，产品从生产加工、检测、装配、入库、派单、到服务全流程数字化、智能化管理，实现资源占用最小化、效率发挥最大化。</p><p>据了解，人机料法环测（5M1E）将生产过程数据与产品制造码进行绑定，便于消费者和监管部门的查询，反向精准追溯到产品的加工检测等信息数据，同时也可由原材料追溯到成品码。在工人不增加的情况下，产能将提升至原先的3至4倍，一二期全部投产后，产值将达到50亿元。这将是国内厨电行业最先进的智能工厂之一。</p><p style=\"text-align: center;\"><img src=\"http://deyi.unohacha.com/Public/Admin/Ueditor/php/../../../../Uploads/upload_admin/20171113/1510557308733562.jpg\" title=\"news_in4.jpg\"/></p><p>智慧工厂的规划启用，意味着在未来市场竞争中拥有更强大的核心竞争力，助推德意占据行业发展的先行地位。它承载着德意奔向高端智造的梦想，推动传统产业转型升级。</p>', '', '', '', '2017-11-09', '1', '', '', '10', null, null, '12', '', '', '', '', '1');
